-- ----------------------------
-- Procedure structure for countOrderItems
-- ----------------------------
DROP PROCEDURE IF EXISTS `countOrderItems`;
DELIMITER ;;
CREATE  PROCEDURE `countOrderItems`( IN companyUuid VARCHAR(25),
    IN auditStatus INT, 						 IN startApplyDate VARCHAR(20), IN endApplyDate VARCHAR(20),  
    IN startArrivalDate VARCHAR(20), IN endArrivalDate VARCHAR(20), IN orderNo VARCHAR(30),
    IN businessUnitUuid VARCHAR(25), IN partsUuid VARCHAR(25),      IN partsTypeUuid VARCHAR(25)
)
BEGIN
    -- 定义临时表,存储结果集
    CREATE TEMPORARY TABLE IF NOT EXISTS temp_items(
      -- 明细表
      uuid VARCHAR(25),
      price DECIMAL(18,2), 
      totalPrice DECIMAL(18,2),
      remark VARCHAR(200),
      -- parts表
      _partsUuid VARCHAR(25),
      partsNo VARCHAR(30),
      partsName VARCHAR(30),
      standard VARCHAR(50),
      partsTypeUuid  VARCHAR(25),
      unitName VARCHAR(35),
      vendorName  VARCHAR(50),
      providerName  VARCHAR(50),
      -- 订单表
      orderNo  VARCHAR(30),
      arrivalDate date,
      commitDate date,
      auditStatus INT,
      applyDepartmentName VARCHAR(35),

      ordersCount INT DEFAULT 0,      -- 订单数
      inventoryCount INT DEFAULT 0,   -- 库存数
      inboundCount INT DEFAULT 0,     -- 入库数
      outboundCount INT DEFAULT 0     -- 出库数
    )ENGINE = MEMORY;

    BEGIN
        /* 缓存统计值, 定义结束标识, 缓存parts_uuid */
        DECLARE temp_count INT;
        DECLARE done INT;
        DECLARE temp_uuid VARCHAR(25);
        DECLARE main_sql VARCHAR(2000) DEFAULT '';
        DECLARE query_sql VARCHAR(1000) DEFAULT '';
        DECLARE all_sql VARCHAR(3500) DEFAULT '';
        -- 为三张需要统计的表定义光标
    DECLARE cur_total  CURSOR FOR SELECT inventory_count, parts_uuid FROM inventory where inventory.parts_uuid IN(select _partsUuid from temp_items);
        DECLARE cur_in       CURSOR FOR SELECT count, parts_uuid FROM parts_inbound_item where parts_inbound_item.parts_uuid IN(select _partsUuid from temp_items);
        DECLARE cur_out      CURSOR FOR SELECT count, parts_uuid FROM parts_outbound_item where parts_outbound_item.parts_uuid IN(select _partsUuid from temp_items);
        DECLARE cur_orders CURSOR FOR SELECT count, parts_uuid FROM parts_purchase_item where parts_purchase_item.parts_uuid IN(select _partsUuid from temp_items);
        DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;  /* 定义光标的结束符 */
        -- 清空临时表,并将指定区间的parts信息装入临时表
        truncate TABLE temp_items;
        SET main_sql = 'INSERT INTO temp_items() 
        SELECT
                items.uuid,
        items.price, 
                items.total_price,
                items.remark,
                parts.uuid as parts_uuid,
        parts.parts_no,
        parts.parts_name,
        parts.standard,
        parts.parts_type_uuid,
        unit.unit_name,
        v.business_unit_name vendorName,
        p.business_unit_name providerName,
        orders.order_no,
        orders.arrival_date,
        orders.create_date AS commitDate,
        orders.audit_status,
        d.department_name AS applyDepartmentName,
                -- 0 as ordersCount,0 as inventoryCount,0 as inboundCount,0 as outboundCount
                 0,0,0,0
    FROM    
        parts_purchase_item items
    LEFT JOIN parts_purchase orders ON orders.uuid = items.parts_purchase_uuid
    LEFT JOIN parts ON parts.uuid = items.parts_uuid
    LEFT JOIN department d ON d.uuid = orders.apply_department_uuid
    LEFT JOIN unit ON parts.unit_uuid = unit.uuid
    LEFT JOIN business_unit v ON v.uuid = parts.vendor_uuid
    LEFT JOIN business_unit p ON p.uuid = parts.provider_uuid';
        

        SET query_sql =  CONCAT(' WHERE items.is_delete = false and items.company_uuid = "',companyUuid,'"');
        -- 检查各个参数是否为null,不为空的参数都拼接到查询条件中
        IF auditStatus > 0
                THEN BEGIN 
                        SET query_sql = CONCAT(query_sql, 'orders.audit_status = ', auditStatus);
                END;
        END IF;
        IF startApplyDate != ''
                THEN SET query_sql = CONCAT(query_sql, ' and DATE(orders.create_date) >= "', DATE(startApplyDate),'"');
        END IF;
        IF endApplyDate != ''
                THEN SET query_sql = CONCAT(query_sql, ' and DATE(orders.create_date) <= "', DATE(endApplyDate),'"');
        END IF;
        IF startArrivalDate != ''
                THEN SET query_sql = CONCAT(query_sql, ' and DATE(orders.arrival_date) >= "', DATE(startArrivalDate),'"');
        END IF;
        IF endArrivalDate != ''
                THEN SET query_sql = CONCAT(query_sql, ' and DATE(orders.arrival_date) <= "', DATE(endArrivalDate),'"');
        END IF;
        IF orderNo != ''
                THEN SET query_sql = CONCAT(query_sql, ' and orders.order_no = "', orderNo,'"');
        END IF;
        IF businessUnitUuid != ''
                THEN BEGIN
                    SET query_sql = CONCAT(query_sql, ' and (v.uuid = "', businessUnitUuid, '" or p.uuid = "', businessUnitUuid, '")');
                END;
        END IF;
        IF partsTypeUuid != ''
                THEN  BEGIN
                    SET query_sql = CONCAT(query_sql, ' and FIND_IN_SET(parts_type.uuid,"', queryPartsTypeChildren(partsTypeUuid), '")');
                    SET main_sql = CONCAT(main_sql, ' LEFT JOIN parts_type ON parts_type.uuid = parts.parts_type_uuid');
                END;
        END IF;
        IF partsUuid != ''
                THEN  BEGIN
                    SET query_sql = CONCAT(query_sql, ' and parts.uuid =" ', partsUuid,'"');
                END;
        END IF;

        -- 编译执行sql
        SET @all_sql = CONCAT(main_sql,query_sql);
        prepare stmt from @all_sql;
				execute stmt;
        deallocate prepare stmt;

        -- 统计订单数
        OPEN cur_orders;
        SET done = 0;  -- 初始化结束标识符
        REPEAT
            SET temp_count = -1; -- 清除缓存的统计值
            FETCH cur_orders INTO temp_count, temp_uuid;
            IF temp_count != -1
                    THEN UPDATE temp_items SET ordersCount = ordersCount + temp_count where temp_items._partsUuid = temp_uuid;
            END IF;
        UNTIL done END REPEAT;
				CLOSE cur_orders;
        -- 统计库存总数
        OPEN cur_total;
        SET done = 0;  -- 初始化结束标识符
        REPEAT
            SET temp_count = -1; -- 清除缓存的统计值
            FETCH cur_total INTO temp_count, temp_uuid;
            IF temp_count != -1
                    THEN UPDATE temp_items SET inventoryCount = inventoryCount + temp_count where _partsUuid = temp_uuid;
            END IF;
        UNTIL done END REPEAT;
				CLOSE cur_total;
        -- 统计入库数
        OPEN cur_in;
        SET done = 0;  -- 初始化结束标识符
        REPEAT
            SET temp_count = -1; -- 清除缓存的统计值
            FETCH cur_in INTO temp_count, temp_uuid;
            IF temp_count != -1
                    THEN UPDATE temp_items SET inboundCount = inboundCount + temp_count where _partsUuid = temp_uuid;
            END IF;
        UNTIL done END REPEAT;
				CLOSE cur_in;
        -- 统计出库数
        OPEN cur_out;
        SET done = 0;  -- 初始化结束标识符
        REPEAT
            SET temp_count = -1; -- 清除缓存的统计值
            FETCH cur_out INTO temp_count, temp_uuid;
            IF temp_count != -1
                    THEN UPDATE temp_items SET outboundCount = outboundCount + temp_count where _partsUuid = temp_uuid;
            END IF;
        UNTIL done END REPEAT;
				CLOSE cur_out;
    END;
    
		SELECT * FROM temp_items;
    TRUNCATE TABLE temp_items;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for countParts
-- ----------------------------
DROP PROCEDURE IF EXISTS `countParts`;
DELIMITER ;;
CREATE  PROCEDURE `countParts`(IN companyUuid VARCHAR(25),
	IN auditStatus INT, IN startApplyDate VARCHAR(20), IN endApplyDate VARCHAR(20),  
	IN startArrivalDate VARCHAR(20), IN endArrivalDate VARCHAR(20), IN orderNo VARCHAR(30),
  IN businessUnitUuid VARCHAR(25), IN partsUuid VARCHAR(25), IN partsTypeUuid VARCHAR(25)
)
BEGIN
	-- params: auditStatus:审核状态
	-- 定义临时表,存储结果集
	CREATE TEMPORARY TABLE IF NOT EXISTS temp_result(
			parts_uuid VARCHAR(25),
			standard VARCHAR(50) ,
			parts_no VARCHAR(30),
			parts_name VARCHAR(30),
			unit_name VARCHAR(35),
			orders_count INT DEFAULT 0,			-- 订单数
		  inventory_count INT DEFAULT 0,	-- 库存数
			inbound_count INT DEFAULT 0,		-- 入库数
			outbound_count INT DEFAULT 0		-- 出库数
	)ENGINE = MEMORY;

	BEGIN
		/* 缓存统计值, 定义结束标识, 缓存parts_uuid */
		DECLARE temp_count INT;
		DECLARE done INT;
		DECLARE temp_uuid VARCHAR(25);
		DECLARE main_sql VARCHAR(2000) DEFAULT '';
		DECLARE query_sql VARCHAR(1000) DEFAULT '';
		-- 为三张需要统计的表定义光标
    DECLARE cur_total  CURSOR FOR SELECT inventory_count, parts_uuid FROM inventory where inventory.parts_uuid IN(select parts_uuid from temp_result);
		DECLARE cur_in 		 CURSOR FOR SELECT count, parts_uuid FROM parts_inbound_item where parts_inbound_item.parts_uuid IN(select parts_uuid from temp_result);
		DECLARE cur_out 	 CURSOR FOR SELECT count, parts_uuid FROM parts_outbound_item where parts_outbound_item.parts_uuid IN(select parts_uuid from temp_result);
		DECLARE cur_orders CURSOR FOR SELECT count, parts_uuid FROM parts_purchase_item where parts_purchase_item.parts_uuid IN(select parts_uuid from temp_result);
		DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;  /* 定义光标的结束符 */
		-- 清空临时表,并将指定区间的parts信息装入临时表
		truncate TABLE temp_result;
		SET main_sql = '
				SELECT DISTINCT (parts.uuid), standard, parts_no, parts_name, unit.unit_name FROM parts_purchase_item 
				LEFT JOIN parts ON parts.uuid = parts_purchase_item.parts_uuid 
				LEFT JOIN unit ON unit.uuid = parts.unit_uuid
				LEFT JOIN parts_purchase orders ON orders.uuid = parts_purchase_item.parts_purchase_uuid
				LEFT JOIN business_unit v ON v.uuid = parts.vendor_uuid
				LEFT JOIN business_unit p ON p.uuid = parts.provider_uuid';
		SET query_sql = CONCAT(' WHERE parts_purchase_item.is_delete = false and parts_purchase_item.company_uuid = "' ,companyUuid, '"');

		-- 检查各个参数是否为null,不为空的参数都拼接到查询条件中
		IF auditStatus > 0
				THEN BEGIN 
						SET query_sql = CONCAT(query_sql, '  and parts_purchase.audit_status = ', auditStatus);
				END;
		END IF;
		IF startApplyDate != ''
				THEN SET query_sql = CONCAT(query_sql, ' and DATE(orders.create_date) >= "', DATE(startApplyDate),'"');
		END IF;
		IF endApplyDate != ''
				THEN SET query_sql = CONCAT(query_sql, ' and DATE(orders.create_date) <= "', DATE(endApplyDate),'"');
		END IF;
		IF startArrivalDate != ''
				THEN SET query_sql = CONCAT(query_sql, ' and DATE(orders.arrival_date) >= "', DATE(startArrivalDate),'"');
		END IF;
		IF endArrivalDate != ''
				THEN SET query_sql = CONCAT(query_sql, ' and DATE(orders.arrival_date) <= "', DATE(endArrivalDate),'"');
		END IF;
		IF orderNo != ''
				THEN SET query_sql = CONCAT(query_sql, ' and orders.order_no = "', orderNo,'"');
		END IF;
		IF businessUnitUuid != ''
				THEN BEGIN
					SET query_sql = CONCAT(query_sql, ' and (v.uuid = "', businessUnitUuid, '" or p.uuid = "', businessUnitUuid, '")');
				END;
		END IF;
		IF partsTypeUuid != ''
				THEN  BEGIN
					SET query_sql = CONCAT(query_sql, ' and FIND_IN_SET(parts_type.uuid,"', queryPartsTypeChildren(partsTypeUuid), '")');
					SET main_sql = CONCAT(main_sql, ' LEFT JOIN parts_type ON parts_type.uuid = parts.parts_type_uuid');
				END;
		END IF;
		IF partsUuid != ''
				THEN  BEGIN
					SET query_sql = CONCAT(query_sql, ' and parts.uuid =" ', partsUuid,'"');
				END;
		END IF;

		-- 编译执行sql
		SET @all_sql = CONCAT(main_sql,query_sql);
		prepare stmt from @all_sql;
    execute stmt;
 		deallocate prepare stmt;

		OPEN cur_orders;
  		SET done = 0;  -- 初始化结束标识符
    REPEAT
			SET temp_count = -1; -- 清除缓存的统计值
			FETCH cur_orders INTO temp_count, temp_uuid;
			IF temp_count != -1
					THEN UPDATE temp_result SET orders_count = orders_count + temp_count where parts_uuid = temp_uuid;
			END IF;
		UNTIL done END REPEAT;

		-- 统计库存总数
		OPEN cur_total;
		SET done = 0;  -- 初始化结束标识符
		REPEAT
			SET temp_count = -1; -- 清除缓存的统计值
			FETCH cur_total INTO temp_count, temp_uuid;
			IF temp_count != -1
					THEN UPDATE temp_result SET inventory_count = inventory_count + temp_count where parts_uuid = temp_uuid;
			END IF;
		UNTIL done END REPEAT;

		-- 统计入库数
		OPEN cur_in;
		SET done = 0;  -- 初始化结束标识符
		REPEAT
			SET temp_count = -1; -- 清除缓存的统计值
			FETCH cur_in INTO temp_count, temp_uuid;
			IF temp_count != -1
					THEN UPDATE temp_result SET inbound_count = inbound_count + temp_count where parts_uuid = temp_uuid;
			END IF;
		UNTIL done END REPEAT;

		-- 统计出库数
		OPEN cur_out;
		SET done = 0;  -- 初始化结束标识符
		REPEAT
			SET temp_count = -1; -- 清除缓存的统计值
			FETCH cur_out INTO temp_count, temp_uuid;
			IF temp_count != -1
					THEN UPDATE temp_result SET outbound_count = outbound_count + temp_count where parts_uuid = temp_uuid;
			END IF;
		UNTIL done END REPEAT;
	END;
	
  SELECT * FROM temp_result;
	TRUNCATE TABLE temp_result;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for faultRepairReports
-- ----------------------------
DROP PROCEDURE IF EXISTS `faultRepairReports`;
DELIMITER ;;
CREATE  PROCEDURE `faultRepairReports`(
  IN  company_uuid_ VARCHAR (17),
  IN  start_date_ VARCHAR (17),
  IN  department_uuid_ VARCHAR (17)
)
BEGIN
DECLARE departmentName VARCHAR(35) DEFAULT '';
DECLARE totalTimes,dontRespondTimes,status1,status2,status3,status4,status5,status6,status7,status8,status9 INT DEFAULT 0;
-- 遍历游标结束标志
DECLARE
    done INT DEFAULT FALSE;
DECLARE department_uuid VARCHAR(17);

DECLARE no_department_uuid_cursor CURSOR FOR SELECT d.uuid FROM department d WHERE d.is_delete=FALSE AND d.company_uuid=company_uuid_ AND d.level=1;
DECLARE department_uuid_cursor CURSOR FOR SELECT d.uuid FROM department d WHERE d.is_delete=FALSE AND d.company_uuid=company_uuid_ AND d.parent_uuid=department_uuid_;
DECLARE CONTINUE HANDLER FOR NOT FOUND
SET done = TRUE;
CREATE TEMPORARY TABLE
-- 创建临时表
IF NOT EXISTS fault_repair_temp (
	departmentName VARCHAR(35),
	totalTimes INT,
	dontRespondTimes INT,
	status1 INT,
	status2 INT,
	status3 INT,
	status4 INT,
	status5 INT,
	status6 INT,
	status7 INT,
	status8 INT,
	status9 INT
);
IF department_uuid_ = '' THEN
  OPEN no_department_uuid_cursor;
ELSE 
  OPEN department_uuid_cursor;
END IF;
REPEAT
	IF department_uuid_  = '' THEN
		FETCH no_department_uuid_cursor INTO department_uuid;
	ELSE 
		FETCH department_uuid_cursor INTO department_uuid;
	END IF;
IF NOT done THEN
-- 部门名称
SELECT d.department_name INTO departmentName FROM department d WHERE d.uuid= department_uuid;
-- 总次数
SELECT
	count(*) INTO totalTimes
FROM
	repair_request_bills r
LEFT JOIN device d ON r.device_uuid = d.uuid
WHERE
r.company_uuid = company_uuid_
AND DATE(r.create_date) > DATE(start_date_)
AND FIND_IN_SET(d.using_department_uuid ,(SELECT queryDepartmentChildren(department_uuid)));
-- 未回应次数
SELECT
	count(*) INTO dontRespondTimes
FROM
	repair_request_bills r
LEFT JOIN device d ON r.device_uuid = d.uuid
WHERE
r.audit_opinion=1 
AND r.audit_opinion!=6
AND	DATE(r.create_date) > DATE(start_date_)
AND r.company_uuid = company_uuid_
AND FIND_IN_SET(d.using_department_uuid ,(SELECT queryDepartmentChildren(department_uuid)));
-- 内修审核中
SELECT
	count(1) INTO status1
FROM
	repair_request_bills r
LEFT JOIN device d ON r.device_uuid = d.uuid
WHERE
r.audit_opinion IN (1,2)
AND	DATE(r.create_date) > DATE(start_date_)
AND r.company_uuid = company_uuid_
AND FIND_IN_SET(d.using_department_uuid ,(SELECT queryDepartmentChildren(department_uuid)));
-- 内修维修中
SELECT
	count(*) INTO status2
FROM
	repair_request_bills r
LEFT JOIN repair_bills rb on r.flow_uuid=rb.flow_uuid
LEFT JOIN device d ON r.device_uuid = d.uuid
WHERE
r.audit_opinion =4
AND rb.repair_type =1
AND	DATE(r.create_date) > DATE(start_date_)
AND r.company_uuid = company_uuid_
AND FIND_IN_SET(d.using_department_uuid ,(SELECT queryDepartmentChildren(department_uuid)));
-- 内修待验证
SELECT
	count(*) INTO status3
FROM
	repair_request_bills r
LEFT JOIN repair_bills rb on r.flow_uuid=rb.flow_uuid
LEFT JOIN device d ON r.device_uuid = d.uuid
WHERE
r.audit_opinion =4 
AND rb.repair_status=8 
AND rb.verify_status IN (0,1)
AND repair_type=1
AND	DATE(r.create_date) > DATE(start_date_)
AND r.company_uuid = company_uuid_
AND FIND_IN_SET(d.using_department_uuid ,(SELECT queryDepartmentChildren(department_uuid)));
-- 内修维修完成
SELECT
	count(*) INTO status4
FROM
	repair_request_bills r
LEFT JOIN repair_bills rb on r.flow_uuid=rb.flow_uuid
LEFT JOIN device d ON r.device_uuid = d.uuid
WHERE
r.audit_opinion =4 
AND rb.repair_status=8 
AND rb.verify_status =4
AND repair_type=1
AND	DATE(r.create_date) > DATE(start_date_)
AND r.company_uuid = company_uuid_
AND FIND_IN_SET(d.using_department_uuid ,(SELECT queryDepartmentChildren(department_uuid)));
-- 被否决
SELECT
	count(*) INTO status5
FROM
	repair_request_bills r
LEFT JOIN device d ON r.device_uuid = d.uuid
WHERE
r.audit_opinion =6
AND	DATE(r.create_date) > DATE(start_date_)
AND r.company_uuid = company_uuid_
AND FIND_IN_SET(d.using_department_uuid ,(SELECT queryDepartmentChildren(department_uuid)));
-- 外修审核中
SELECT
	count(*) INTO status6
FROM
	repair_bills rb
LEFT JOIN device d ON rb.device_uuid = d.uuid 
WHERE 
rb.audit_status IN (0,1)
AND repair_type IN (2,3)
AND	DATE(rb.create_date) > DATE(start_date_)
AND rb.company_uuid = company_uuid_
AND FIND_IN_SET(d.using_department_uuid ,(SELECT queryDepartmentChildren(department_uuid)));
-- 外修维修中
SELECT
	count(*) INTO status7
FROM
	repair_bills rb 
LEFT JOIN device d ON rb.device_uuid = d.uuid
WHERE 
rb.audit_status =4
AND verify_status IS NULL
AND repair_type IN (2,3)
AND	DATE(rb.create_date) > DATE(start_date_)
AND rb.company_uuid = company_uuid_
AND FIND_IN_SET(d.using_department_uuid ,(SELECT queryDepartmentChildren(department_uuid)));
-- 外修待验证
SELECT
	count(*) INTO status8
FROM
	repair_bills rb
LEFT JOIN device d ON rb.device_uuid = d.uuid
WHERE 
rb.audit_status =4
AND verify_status IN (0,1)
AND repair_type IN (2,3)
AND	DATE(rb.create_date) > DATE(start_date_)
AND rb.company_uuid = company_uuid_
AND FIND_IN_SET(d.using_department_uuid ,(SELECT queryDepartmentChildren(department_uuid)));
-- 外修维修完成
SELECT
	count(*) INTO status9
