;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for getMy
-- ----------------------------
DROP PROCEDURE IF EXISTS `getMy`;
DELIMITER ;;
CREATE  PROCEDURE `getMy`()
BEGIN
	DECLARE item_count_ VARCHAR(5000) DEFAULT "";
	DECLARE oneFailureType VARCHAR(50); -- 第一级id
	DECLARE manyFilureType varchar(5000); -- 某级别下所有的id
	DECLARE end_flag INT DEFAULT 0;
	DECLARE oneMount int ; -- 第一级个数
	DECLARE oneLevelCur CURSOR for select ft.uuid from failure_type ft where ft.is_delete=false and ft.level=1; -- 第一级游标
	DECLARE  CONTINUE HANDLER FOR NOT FOUND SET end_flag = 1;
	DROP TABLE IF EXISTS failu;
	CREATE TEMPORARY TABLE failu(
	id VARCHAR(50)
	);
	OPEN oneLevelCur;
	REPEAT
		FETCH oneLevelCur INTO oneFailureType;
	IF end_flag!=1
	THEN
	 -- INSERT  INTO failu(id) SELECT t.uuid from failure_type t where FIND_IN_SET(t.uuid,query_child_failure_type(oneFailureType));
	 SELECT count(*) INTO oneMount from repair_bills rb 
	LEFT JOIN device d on d.uuid=rb.device_uuid
	where FIND_IN_SET(rb.failure_type_uuid,(select query_child_failure_type(oneFailureType)));
	SET item_count_=CONCAT(item_count_,",",oneMount);

	END IF;
	UNTIL end_flag=1
	END REPEAT;
	 CLOSE oneLevelCur;
  SELECT item_count_;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for levelOneforTheSituation
-- ----------------------------
DROP PROCEDURE IF EXISTS `levelOneforTheSituation`;
DELIMITER ;;
CREATE  PROCEDURE `levelOneforTheSituation`(
    IN partsTypeUuid varchar(17),
    IN companyUuid VARCHAR(17),
    IN peroid decimal(18,2),
    IN beginTime VARCHAR(30),
    IN endTime VARCHAR(30),
    out inboundPrice decimal(18,2),
    out outboundPrice decimal(18,2),
    OUT preliminaryTotalPrice decimal(18,2))
BEGIN
    ##传入备件类型level=1的uuid,查询出此段时间的出入库情况及初期金额
    -- 树下所有节点 ,  树下的一个子节点 ,  查询出来备件的uuid 并拼接 , 查询记录的sql语句 ,  查询库存的sql语句,  日期查询动态条件,  日期之前的动态sql
    DECLARE sTemp,sTempChd,partsUuidArr,recordSql,inventorySql,inDateSql,beforeDateSql VARCHAR(4000); 
        SET sTemp = '''u'''; -- 查询树下(包括自己)所有节点
        SET sTempChd = partsTypeUuid ; -- 需要查询的最顶级树的uuid，到时需要遍历
        #记录表动态查询，根据传入的时间参数动态查询出此段时间内的uuid并拼接
        SET recordSql = CONCAT('select group_concat(uuid) INTO @recordUuidArr from inventory_record where company_uuid = ',companyUuid);
        #初期库存查询，根据传入时间的值，查询出最初的库存金额
        SET inventorySql = CONCAT('select sum(re.total) INTO @preliminaryTotalPrice  from inventory_record re left join inventory i on i.uuid = re.inventory_uuid where re.company_uuid = ',companyUuid);

        WHILE sTempChd is not NULL DO
            SET sTemp = CONCAT(sTemp,',',sTempChd); -- 拼接字符串，以，为分隔符
            SELECT group_concat(uuid) INTO sTempChd FROM parts_type where company_uuid = companyUuid and FIND_IN_SET(parent_uuid,sTempChd)>0 ORDER BY parent_uuid; -- 查询此树下所有的uuid，并拼接进sTempChd
        END WHILE;
        select group_concat(uuid) into @partsUuidArr from parts where company_uuid = companyUuid and find_in_set(parts_type_uuid,sTemp); -- 查询有库存记录的备件uuid,并拼接

        SET inDateSql = CONCAT(' and DATE(create_date) >=  DATE("',beginTime,'") and DATE(create_date) <= DATE("',endTime,'")');    
        SET beforeDateSql = CONCAT(' and DATE(re.create_date) <  DATE("',beginTime,'")');     -- 本年初期金额时间应小于本年       

            SET recordSql = CONCAT(recordSql,inDateSql);    -- 记录表动态sql
            SET inventorySql = CONCAT(inventorySql,beforeDateSql,' and find_in_set(i.parts_uuid,@partsUuidArr)'); -- 库存表sql
            #预处理记录表，得到需要查询的recordUuid
            set @recordSql = recordSql;
            prepare stmt from @recordSql;
            execute stmt;
            deallocate prepare stmt;
            #预处理库存表,得到查询之前总库存金额
            set @inventorySql = inventorySql;
            prepare stmt from @inventorySql;
            execute stmt;
            deallocate prepare stmt;
            set preliminaryTotalPrice = @preliminaryTotalPrice; -- 设置初期金额并使之保存
        -- select recordUuidArr,preliminaryTotalPrice;
        -- 已经查询出顶级树下所有节点包含的备件的uuid，查询出这些备件包含的总价，出入库总金额记录即可
        select SUM(if(re.is_inbound,re.total,0)),SUM(if(re.is_inbound,0,re.total)) into inboundPrice, outboundPrice
        from inventory_record re 
        left join inventory i on i.uuid =re.inventory_uuid 
        left join parts p on p.uuid = i.parts_uuid 
        where find_in_set(p.uuid,@partsUuidArr) and find_in_set(re.uuid,@recordUuidArr);
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for maintenance_year_plan
-- ----------------------------
DROP PROCEDURE IF EXISTS `maintenance_year_plan`;
DELIMITER ;;
CREATE  PROCEDURE `maintenance_year_plan`(IN planYear INTEGER(25),IN maintenanceLevelUuid VARCHAR(25),IN departmentUuid VARCHAR(25),IN companyUuid VARCHAR(25))
BEGIN
DECLARE maintenance_plan_uuid_ VARCHAR(25); -- 保养单uuid 
DECLARE device_no_ VARCHAR(40); -- 设备编号
DECLARE device_name_ VARCHAR(40); -- 设备名字
DECLARE standard_ VARCHAR(30); -- 设备型号
DECLARE department_name_ VARCHAR(40); -- 使用部门
DECLARE maintenance_level_name_ VARCHAR(40); -- 保养等级
DECLARE maintenance_parts_ VARCHAR(40); -- 保养部位
DECLARE maintenance_standard_ VARCHAR(40); -- 保养标准
DECLARE description_ VARCHAR(40); -- 描述
DECLARE plan_maintenance_date_ TIMESTAMP; -- 计划保养时间
DECLARE wait_execute_time_ VARCHAR(500) DEFAULT ""; -- 待执行次数 月分布
DECLARE end_flag INT(1) DEFAULT 0; -- 游标结束标记
DECLARE loops_period_type_ INT(1);  -- 循环周期方式 年 月 日
DECLARE loops_period_ INT(1); -- 循环周期
DECLARE loops_type_ BIGINT(1); -- 循环方式
DECLARE n INT(10) DEFAULT 1; -- 循环下标
DECLARE frequence INT(10) DEFAULT 0; -- 次数
DECLARE plan_maintenance_date_temp TIMESTAMP; -- 计划保养时间临时变量
DECLARE nextMonth INT(10) DEFAULT 0; -- 下个月
DECLARE endDate TIMESTAMP; -- 终止时间
DECLARE plan_year_month VARCHAR(80);-- 查询日期字符串
DECLARE plan_year_month_date VARCHAR(30); -- 查询日期
DECLARE mainte_cursor CURSOR FOR select d.uuid,d.device_no,d.device_name,d.standard,dep.department_name,
ml.maintenance_level_name,mp.maintenance_parts,mp.maintenance_standard,mp.description,mp.plan_maintenance_date,mp.loops_period_type,mp.loops_period,mp.loops_type,mp.end_date
from maintenance_plan mp
LEFT JOIN device d on d.uuid=mp.device_uuid
LEFT JOIN department dep on dep.uuid=d.using_department_uuid
LEFT JOIN maintenance_level ml on ml.uuid=mp.maintenance_level_uuid
where mp.is_excuted=FALSE and mp.is_delete=FALSE 
and IF(maintenanceLevelUuid,mp.maintenance_level_uuid=maintenanceLevelUuid,"1=1") 
and IF(departmentUuid,dep.uuid=departmentUuid,"1=1")
and mp.company_uuid=companyUuid ORDER BY mp.create_date ASC;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_flag=1;
-- 用于存放所有记录的临时表
drop TABLE IF EXISTS all_maintenance_plan;
create TEMPORARY TABLE all_maintenance_plan(
 device_no VARCHAR(40), -- 设备编号
 device_name VARCHAR(40), -- 设备名字
 standard VARCHAR(30), -- 设备型号
 department_name VARCHAR(40), -- 使用部门
 maintenance_level_name VARCHAR(40), -- 保养等级
 maintenance_parts VARCHAR(40), -- 保养部位
 maintenance_standard VARCHAR(40), -- 保养标准
 description VARCHAR(40), -- 描述
 plan_maintenance_date TIMESTAMP, -- 计划保养时间
 wait_execute_time VARCHAR(500) -- 待执行次数 月分布
);
IF planYear IS NOT NULL
THEN
OPEN mainte_cursor;
REPEAT
FETCH mainte_cursor INTO maintenance_plan_uuid_,device_no_,device_name_,standard_,department_name_,maintenance_level_name_,
maintenance_parts_,maintenance_standard_,description_,plan_maintenance_date_,loops_period_type_,loops_period_,loops_type_,endDate;
SET plan_maintenance_date_temp=plan_maintenance_date_;
SET plan_year_month=planYear;
IF end_flag!=1
THEN
		IF loops_type_=1 -- 单次循环
		THEN
			SET n=0;-- 循环下标
			while n<12
			DO
				IF planYear!=DATE_FORMAT(plan_maintenance_date_,"%Y")
				THEN
					SET wait_execute_time_=CONCAT(wait_execute_time_,",",0);
				ELSE
					IF DATE_FORMAT(plan_maintenance_date_,"%m")!=n 
					THEN
						SET wait_execute_time_=CONCAT(wait_execute_time_,",",0);
					ELSE
						IF DATE_FORMAT(plan_maintenance_date_,"%Y-%m-%d")<CURDATE()
						THEN 
							SET wait_execute_time_=CONCAT(wait_execute_time_,",",0);
						ELSE 
							SET wait_execute_time_=CONCAT(wait_execute_time_,",",1);
						END IF;
					END IF;
				END IF;
				SET n=n+1;
			END WHILE;
	 ELSE  -- 多次循环
				
			 set n=1;
			 WHILE n<=12
			 DO
			 SET plan_year_month=CONCAT(planYear,"-",n,"-","01");
			 set plan_year_month_date=DATE_FORMAT(DATE(plan_year_month),"%Y-%m");
			 IF  plan_year_month_date<DATE_FORMAT(DATE(plan_maintenance_date_),"%Y-%m")-- 还未到计划保养年月
			 THEN 					
					SET wait_execute_time_=CONCAT(wait_execute_time_,",",0);
			 ELSE  -- 到计划保养年月
								SET nextMonth=n;
								SET frequence=0;	
								CASE 
								WHEN loops_period_type_=1 -- 天
										THEN
											WHILE planYear!=YEAR(plan_maintenance_date_temp)
											DO
											SET	plan_maintenance_date_temp=DATE_ADD(plan_maintenance_date_temp,INTERVAL loops_period_ DAY);-- 跳转到查询那一年
											END WHILE;
										WHILE nextMonth=n -- 未达到月底
										DO
											IF DATE_FORMAT(plan_maintenance_date_temp,"%Y-%m-%d")<CURDATE() -- 计划保养时间已经过期
											THEN
											SET	plan_maintenance_date_temp=DATE_ADD(plan_maintenance_date_temp,INTERVAL loops_period_ DAY);
											set nextMonth=MONTH(plan_maintenance_date_temp);
											ELSE
												IF	plan_maintenance_date_temp<=endDate AND YEAR(plan_maintenance_date_temp)=planYear -- 计划保养临时时间小于终止时间
												THEN
													SET frequence=frequence+1;
												END IF;
													 SET	plan_maintenance_date_temp=DATE_ADD(plan_maintenance_date_temp,INTERVAL loops_period_ DAY);
													set nextMonth=MONTH(plan_maintenance_date_temp);
											END IF;
										END WHILE;
								 WHEN loops_period_type_=2 -- 月
											THEN
											WHILE planYear!=YEAR(plan_maintenance_date_temp)
											DO
											SET	plan_maintenance_date_temp=DATE_ADD(plan_maintenance_date_temp,INTERVAL loops_period_ MONTH);-- 跳转到查询那一年
											END WHILE;
											IF DATE_FORMAT(plan_maintenance_date_temp,"%Y-%m-%d")<CURDATE() -- 计划保养时间已经过期
											THEN
												SET frequence=0;
												SET plan_maintenance_date_temp=DATE_ADD(plan_maintenance_date_temp,INTERVAL loops_period_ MONTH);
											ELSEIF MONTH(plan_maintenance_date_temp)=n 
											THEN 
												IF	plan_maintenance_date_temp<=endDate 
												THEN
													SET frequence=1;
												ELSE
													SET frequence=0;
												end IF;
												SET plan_maintenance_date_temp=DATE_ADD(plan_maintenance_date_temp,INTERVAL loops_period_ MONTH);
											ELSE
											SET frequence=0;
											END IF;
								 WHEN loops_period_type_=3 -- 年
										then
										WHILE planYear!=YEAR(plan_maintenance_date_temp)
										DO
										SET	plan_maintenance_date_temp=DATE_ADD(plan_maintenance_date_temp,INTERVAL loops_period_ YEAR);-- 跳转到查询那一年
										END WHILE;
										IF DATE_FORMAT(plan_maintenance_date_temp,"%Y-%m-%d")<CURDATE() -- 计划保养时间已经过期
											THEN
										SET frequence=0;
										ELSE 
												IF	plan_maintenance_date_temp<=endDate AND MONTH(plan_maintenance_date_temp)=n
												THEN
													SET frequence=1;
												ELSE
													SET frequence=0;
												END IF;
										END IF;
								END CASE;
						SET wait_execute_time_=CONCAT(wait_execute_time_,",",frequence);
				END IF;
				SET n=n+1;
			 END WHILE;
	


		END IF;
maintenance_parts_,maintenance_standard_,description_,plan_maintenance_date_,wait_execute_time_);
SET wait_execute_time_="";
END IF;
UNTIL end_flag=1
END REPEAT;
CLOSE mainte_cursor;
END IF;
  SELECT * from all_maintenance_plan;
-- select CONVERT(plan_year_month,DATE);
-- select plan_year_month;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for partsMove
-- ----------------------------
DROP PROCEDURE IF EXISTS `partsMove`;
DELIMITER ;;
CREATE  PROCEDURE `partsMove`(
        IN companyUuid VARCHAR(17),
        IN partsUuid varchar(17),
        IN count decimal(18,2),
        IN fromStorageUuid VARCHAR(17),
        IN fromStorageLocationUuid VARCHAR(17),
        IN toStorageLocationUuid VARCHAR(17),
        IN moveType INT(1))
begin
    DECLARE inventoryUuid VARCHAR(17);
    DECLARE fromLocationCount,toLocationCount decimal(18,2);

    #查询出发生移动的仓库库存
    select uuid into inventoryUuid from inventory where company_uuid = companyUuid and storage_uuid = fromStorageUuid and parts_uuid = partsUuid;
    #查询被转移的库位库存
    select location_count into fromLocationCount from inventory_location where company_uuid = companyUuid and storage_location_uuid = fromStorageLocationUuid and parts_uuid = partsUuid;
    #查询出转移到的库位库存
    select location_count into toLocationCount from inventory_location where company_uuid = companyUuid and storage_location_uuid = toStorageLocationUuid and parts_uuid = partsUuid;
    
    #处理需要增加库位库存
    if toLocationCount is null and moveType != 2 THEN   -- 上架时，转移到的库位不存在库存,则在库位库存上添加一个字段
              values (UUID_SHORT(),partsUuid,inventoryUuid,toStorageLocationUuid,count,0,companyUuid,NOW(),null,NOW(),null);
    ELSE     -- 转移到的库位存在库存
        set toLocationCount = toLocationCount + count;
        update inventory_location set location_count = tolocationCount where  storage_location_uuid = toStorageLocationUuid and parts_uuid = partsUuid;
    end if; 

    #处理需要减少的库位库存
    if fromStorageLocationUuid is not null THEN -- 表示下架，或者移动时的移出库位
        set fromLocationCount = fromLocationCount - count;
        update inventory_location set location_count =fromLocationCount where storage_location_uuid = fromStorageLocationUuid and parts_uuid = partsUuid;
    end if;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for partsReportsByDate
-- ----------------------------
DROP PROCEDURE IF EXISTS `partsReportsByDate`;
DELIMITER ;;
CREATE  PROCEDURE `partsReportsByDate`(
    IN companyUuid VARCHAR (17),
    IN beginTime VARCHAR (17),
    IN endTime VARCHAR (17),
    IN storageUuid VARCHAR(17),
    IN partsTypeUuid VARCHAR(17)
)
BEGIN
create temporary table if not exists partsBillsByDate   
      ( 
        partsName VARCHAR(50), -- 货品名称
        partsNo VARCHAR(30), -- 货品编码
        partsTypeName VARCHAR(50), -- 货品类型
        standard VARCHAR(17), -- 规格型号
        unitName VARCHAR(17), -- 计量单位
        inboundCount FLOAT(17), -- 入库数量
        inboundTotal FLOAT(17), -- 入库金额
        inboundTime FLOAT(17), -- 入库笔数
        outboundCount FLOAT(17), -- 出库数量
        outboundTotal FLOAT(17), -- 出库金额
        outboundTime FLOAT(17), -- 出库笔数
        costPrice FLOAT(17), -- 成本额
        primeInventoryCount FLOAT(17), -- 期初库存
        lastInventoryCount FLOAT(17), -- 期末库存
        primeTotalPrice FLOAT(17), -- 期初金额
        lastTotalPrice FLOAT(17), -- 期末金额
        averageCost FLOAT(17) -- 期末平均成本  
       ) ENGINE = MEMORY;
BEGIN
    DECLARE s INT DEFAULT 0;
    DECLARE recordSql VARCHAR(500);
    DECLARE partsUuid VARCHAR(17);
    DECLARE recordUuidArr VARCHAR(4000);

-- 表示符，用于游标结束标志
DECLARE cursor_name CURSOR FOR SELECT uuid FROM parts WHERE company_uuid = companyUuid AND is_delete = FALSE;

-- 创建一个游标 当游标结束时 s=1
DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET s = 1;
-- SET @recordUuidArr := 0;
-- 记录表动态查询，根据传入的时间参数动态查询出此段时间内的uuid并拼接
SET recordSql = CONCAT('select group_concat(uuid) INTO @recordUuidArr from inventory_record where company_uuid = ',companyUuid);
set recordSql =CONCAT(recordSql ,' and DATE("',beginTime,'")<= DATE(create_date) and  DATE(create_date)  <= DATE("',endTime,'")'); 

set @recordSql = recordSql;
        prepare stmt from @recordSql;
    execute stmt;
        deallocate prepare stmt;
 set recordUuidArr = @recordUuidArr;

OPEN cursor_name;

-- 启动游标
REPEAT
    -- 循环
    -- 获取游标当前指针的记录，读取一行数据并传值
    FETCH cursor_name INTO partsUuid;
    select sum(if(re.is_inbound,re.count,0))-sum(if(re.is_inbound,0,re.count)),
    sum(if(re.is_inbound,re.total,0))- sum(if(re.is_inbound,0,re.total))
    INTO @primeInventoryCount,@primeTotalPrice 
    from inventory_record re
    left join inventory i on i.uuid = re.inventory_uuid
    where re.company_uuid = companyUuid and DATE(re.create_date) <  DATE(beginTime)
    and i.parts_uuid = partsUuid;

SELECT p.parts_name,p.parts_no,pt.parts_type_name,p.standard,u.unit_name,
    sum(IF (re.is_inbound, re.count, 0)),
    sum(IF (re.is_inbound, re.total, 0)),
    sum(IF(re.is_inbound, 1, 0)),
    sum(IF (re.is_inbound, 0, re.count)),
    sum(IF (re.is_inbound, 0, re.total)),
    sum(IF(re.is_inbound, 0, 1))
    INTO @partsName, @partsNo, @partsTypeName, @standard, @unitName,@inboundCount,@inboundTotal,@inboundTime,@outboundCount,@outboundTotal,@outboundTime
FROM
    inventory_record re
LEFT JOIN inventory i ON i.uuid = re.inventory_uuid
LEFT JOIN parts p ON p.uuid = i.parts_uuid
LEFT JOIN parts_type pt ON p.parts_type_uuid = pt.uuid
LEFT JOIN unit u ON p.unit_uuid = u.uuid
WHERE re.company_uuid = companyUuid and p.is_delete = '0' 
AND p.uuid = partsUuid and FIND_IN_SET(re.uuid,@recordUuidArr);

                inboundCount, inboundTotal, inboundTime, outboundCount, outboundTotal, outboundTime, costPrice,
                primeInventoryCount, lastInventoryCount, primeTotalPrice, lastTotalPrice, averageCost )
       values (@partsName, @partsNo, @partsTypeName, @standard, @unitName,
                @inboundCount, @inboundTotal, @inboundTime, @outboundCount, @outboundTotal, @outboundTime, @costPrice,
                @primeInventoryCount, @lastInventoryCount, @primeTotalPrice, @lastTotalPrice, @averageCost);

UNTIL s END REPEAT;

-- 关闭游标
CLOSE cursor_name;

end;

select partsName, partsNo, partsTypeName, standard, unitName,
             inboundCount, inboundTotal, inboundTime, outboundCount, outboundTotal, outboundTime, costPrice,
             primeInventoryCount, lastInventoryCount, primeTotalPrice, lastTotalPrice, averageCost  
from partsBillsByDate; -- 查询临时表

DROP TEMPORARY TABLE partsBillsByDate;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for partsTypeCollect
-- ----------------------------
DROP PROCEDURE IF EXISTS `partsTypeCollect`;
DELIMITER ;;
CREATE  PROCEDURE `partsTypeCollect`(IN companyUuid VARCHAR (17),
	IN peroid DECIMAL (18, 2),
	IN beginTime VARCHAR (30),
	IN endTime VARCHAR (30))
BEGIN
	#按备件类型汇总，返回需要的整个字段
	#创建临时表，字段与页面显示相同
	CREATE TEMPORARY TABLE
IF NOT EXISTS partsTypeCollect (
	partsTypeName VARCHAR (50),
	beginCount FLOAT (50),
	inboundPrice FLOAT (17),
	outboundPrice FLOAT (17)
) ENGINE = MEMORY;


BEGIN
	DECLARE
		count INT (10);

-- parentUuid=0的类型的个数
DECLARE
	i INT (10);

-- 遍历时的i
DECLARE
	partsTypeName VARCHAR (18);

-- 备件名称
DECLARE
	inboundPrice,
	outboundPrice,
	partsTypeUuid,
	beginCount FLOAT (17);

-- 入库总价,出库总价,备件类型UUid,初期金额
DECLARE
	s INT DEFAULT 0;

-- 表示符，用于游标结束标志
DECLARE
	cursor_name CURSOR FOR SELECT
		uuid,
		parts_type_name
	FROM
		parts_type
	WHERE
		is_delete = FALSE
	AND company_uuid = companyUuid
	AND LEVEL = 1;

-- 创建一个游标
# 当游标结束时 s=1
DECLARE
	CONTINUE HANDLER FOR SQLSTATE '02000'
SET s = 1;

OPEN cursor_name;

-- 启动游标
REPEAT
	-- 循环
	#获取游标当前指针的记录，读取一行数据并传值
	FETCH cursor_name INTO partsTypeUuid,
	partsTypeName;

CALL levelOneforTheSituation (
	partsTypeUuid,
	companyUuid,
	peroid,
	beginTime,
	endTime,
	inboundPrice,
	outboundPrice,
	beginCount
);

-- 查询此过程下的出入库金额，初期金额
	partsTypeName,
	beginCount,
	inboundPrice,
	outboundPrice
)
VALUES
	(
		partsTypeName,
		beginCount,
		inboundPrice,
		outboundPrice
	);

-- 添加到临时表
UNTIL s
END
REPEAT
;

CLOSE cursor_name;

-- 关闭游标
END;

SELECT
	partsTypeName,
	beginCount,
	inboundPrice,
	outboundPrice
FROM
	partsTypeCollect;

-- 查询临时表
TRUNCATE TABLE partsTypeCollect;

-- 清除临时表数据
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pr_add
-- ----------------------------
DROP PROCEDURE IF EXISTS `pr_add`;
DELIMITER ;;
CREATE  PROCEDURE `pr_add`(In departmentUuid VARCHAR(17))
begin
	DECLARE deviceUuid varchar(4000);  -- 部门下的设备uuid拼接
	DECLARE repairLevel varchar(4000);
	DECLARE number INT(17);
	DECLARE a varchar(4000);
	DECLARE  s INT DEFAULT 0;
	DECLARE  cur_product CURSOR FOR select rl.repair_level,count(rb.repair_level_uuid) from repair_bills rb LEFT JOIN repair_level rl on rb.repair_level_uuid=rl.uuid
	where FIND_IN_SET(rb.device_uuid,(select group_concat(uuid) from device where using_department_uuid = departmentUuid)) GROUP BY rb.repair_level_uuid; 
	DECLARE  CONTINUE HANDLER FOR NOT FOUND  SET  s = 1;
	OPEN cur_product;
	set a = '{';
	REPEAT    
				FETCH cur_product INTO repairLevel, number;
				set a = CONCAT(a,'"',repairLevel,'":',number,',');
			-- insert into infologs(repairLevel,number)  values (a,number);
        -- FETCH cur_product INTO @repairLevel, @number; /*取下一条记录*/
	UNTIL s = 1
  END REPEAT;
	set a=CONCAT(a,'}');
	close cur_product;
	SELECT a;
	end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for queryHeaderRemind
-- ----------------------------
DROP PROCEDURE IF EXISTS `queryHeaderRemind`;
DELIMITER ;;
CREATE  PROCEDURE `queryHeaderRemind`(
	IN company_uuid_ VARCHAR (17),
	IN login_uuid_ VARCHAR (17)
)
BEGIN
	DECLARE
		todayRepairRecords,
		todayMaintenancePlanRecords,
		innerAuditRecords,
		outterAuditRecords,
		inRepairRecords,
		waitVerifyRecords INT DEFAULT 0;

-- 今日维修
SELECT
	count(*) INTO todayRepairRecords
FROM
	repair_bills r
LEFT JOIN device d ON r.device_uuid = d.uuid
LEFT JOIN department dep ON d.using_department_uuid = dep.uuid
LEFT JOIN user rep ON r.report_by = rep.uuid
LEFT JOIN maintenance_group mg ON r.maintenance_group_uuid = mg.uuid
LEFT JOIN business_unit bu ON r.business_unit_uuid = bu.uuid
LEFT JOIN repair_level rl ON r.repair_level_uuid = rl.uuid
LEFT JOIN failure_type ft ON r.failure_type_uuid = ft.uuid
LEFT JOIN user oau ON oau.uuid = r.outter_apply_by
LEFT JOIN defect_level dl ON dl.uuid = r.defect_level_uuid
WHERE
	r.is_delete = FALSE
AND r.company_uuid = company_uuid_
AND DATE_FORMAT(
	r.repair_start_date,
	'%Y-%m-%d'
) = (SELECT CURDATE());

-- 今日保养计划
SELECT
	count(*) INTO todayMaintenancePlanRecords
FROM
	maintenance_plan mp
LEFT JOIN device de ON mp.device_uuid = de.uuid
LEFT JOIN department dp ON de.using_department_uuid = dp.uuid
LEFT JOIN maintenance_level ml ON ml.uuid = mp.maintenance_level_uuid
LEFT JOIN maintenance_group mg ON mg.uuid = mp.maintenance_group_uuid
LEFT JOIN user u ON u.uuid = mp.create_by
LEFT JOIN device_type dt ON dt.uuid = de.device_type_uuid
WHERE
	mp.is_delete = FALSE
AND mp.company_uuid = company_uuid_
AND mp.is_excuted = FALSE
AND mp.plan_maintenance_date = (SELECT CURDATE())
AND mp.end_date >= (SELECT CURDATE());

-- 内修待审核
SELECT
	count(*) INTO innerAuditRecords
FROM
	repair_request_bills r
LEFT JOIN device d ON d.uuid = r.device_uuid
LEFT JOIN department dep ON dep.uuid = d.using_department_uuid
LEFT JOIN maintenance_group m ON m.uuid = r.maintenance_group_uuid
LEFT JOIN failure_type f ON f.uuid = r.failure_type_uuid
LEFT JOIN defect_level def ON def.uuid = r.defect_level_uuid
LEFT JOIN repair_bills rp ON r.flow_uuid = rp.flow_uuid
LEFT JOIN repair_plan p ON r.flow_uuid = p.flow_uuid
WHERE
	r.is_delete = FALSE
AND r.company_uuid = company_uuid_
AND r.audit_opinion IN (1)
AND (
	rp.repair_type IS NULL
	OR rp.repair_type IN (1)
)
AND date_format(r.create_date, '%Y-%m') = date_format(now(), '%Y-%m');

-- 外修待我审核
SELECT
	count(1) INTO outterAuditRecords
FROM
	repair_request_bills r
LEFT JOIN device d ON d.uuid = r.device_uuid
LEFT JOIN department dep ON dep.uuid = d.using_department_uuid
LEFT JOIN maintenance_group m ON m.uuid = r.maintenance_group_uuid
LEFT JOIN failure_type f ON f.uuid = r.failure_type_uuid
LEFT JOIN defect_level def ON def.uuid = r.defect_level_uuid
LEFT JOIN repair_bills rp ON r.flow_uuid = rp.flow_uuid
LEFT JOIN repair_plan p ON r.flow_uuid = p.flow_uuid
LEFT JOIN user u ON r.audit_by = u.uuid
INNER JOIN (
	SELECT
		new.flow_uuid,
		new.groups_uuid,

	IF (
		COUNT(new.flow_uuid) = 1,

	IF (new.groups_uuid, 1, 0),
	COUNT(new.flow_uuid)
	) AS count
	FROM
		(
			SELECT
				rb.flow_uuid,
				rba.groups_uuid
			FROM
				repair_bills rb
			LEFT JOIN repair_bills_audit rba ON rb.flow_uuid = rba.flow_uuid
			AND rba.groups_uuid IN (
				SELECT DISTINCT
					ug.group_uuid
				FROM
					user_group ug
				WHERE
					ug.user_uuid = login_uuid_
				AND ug.group_uuid IN (
					SELECT
						groups_uuid
					FROM
						(
							(
								SELECT
									w.outer_repaire_id1 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
							UNION
								(
									SELECT
										w.outer_repaire_id2 AS groups_uuid
									FROM
										work_flow w
									WHERE
										w.company_uuid = company_uuid_
								)
							UNION
								(
									SELECT
										w.outer_repaire_id3 AS groups_uuid
									FROM
										work_flow w
									WHERE
										w.company_uuid = company_uuid_
								)
							UNION
								(
									SELECT
										w.outer_repaire_id4 AS groups_uuid
									FROM
										work_flow w
									WHERE
										w.company_uuid = company_uuid_
								)
						) groups_uuids
				)
			)
		) AS new
	GROUP BY
		new.flow_uuid
	HAVING
		count < (
			SELECT DISTINCT
				count(1)
			FROM
				user_group ug
			WHERE
				ug.user_uuid = login_uuid_
			AND ug.group_uuid IN (
				SELECT
					groups_uuid
				FROM
					(
						(
							SELECT
								w.outer_repaire_id1 AS groups_uuid
							FROM
								work_flow w
							WHERE
								w.company_uuid = company_uuid_
						)
						UNION
							(
								SELECT
									w.outer_repaire_id2 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
						UNION
							(
								SELECT
									w.outer_repaire_id3 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
						UNION
							(
								SELECT
									w.outer_repaire_id4 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
					) groups_uuids
			)
		)
) AS not_finish ON rp.flow_uuid = not_finish.flow_uuid
WHERE
	r.is_delete = FALSE
AND r.company_uuid = company_uuid_
AND rp.repair_type IN (2, 3)
AND (
	rp.audit_status IN (0, 1)
	OR rp.audit_status IS NULL
)
AND date_format(r.create_date, '%Y-%m') = date_format(now(), '%Y-%m');

-- 内修维修中
SELECT
	count(*) INTO inRepairRecords
FROM
	repair_request_bills r
LEFT JOIN device d ON d.uuid = r.device_uuid
LEFT JOIN department dep ON dep.uuid = d.using_department_uuid
LEFT JOIN maintenance_group m ON m.uuid = r.maintenance_group_uuid
LEFT JOIN failure_type f ON f.uuid = r.failure_type_uuid
LEFT JOIN defect_level def ON def.uuid = r.defect_level_uuid
LEFT JOIN repair_bills rp ON r.flow_uuid = rp.flow_uuid
LEFT JOIN repair_plan p ON r.flow_uuid = p.flow_uuid
WHERE
	r.is_delete = FALSE
AND r.company_uuid = company_uuid_
AND r.audit_opinion IN (4)
AND rp.repair_status IN (1, 2, 3, 4, 5, 7)
AND (
	rp.repair_type IS NULL
	OR rp.repair_type IN (1)
)
AND date_format(r.create_date, '%Y-%m') = date_format(now(), '%Y-%m');

-- 维修结束待验证
SELECT
	count(*) INTO waitVerifyRecords
FROM
	repair_request_bills r
LEFT JOIN device d ON d.uuid = r.device_uuid
LEFT JOIN department dep ON dep.uuid = d.using_department_uuid
LEFT JOIN maintenance_group m ON m.uuid = r.maintenance_group_uuid
LEFT JOIN failure_type f ON f.uuid = r.failure_type_uuid
LEFT JOIN defect_level def ON def.uuid = r.defect_level_uuid
LEFT JOIN repair_bills rp ON r.flow_uuid = rp.flow_uuid
LEFT JOIN repair_plan p ON r.flow_uuid = p.flow_uuid
WHERE
	r.is_delete = FALSE
AND r.company_uuid = company_uuid_
AND r.audit_opinion IN (4)
AND rp.repair_status IN (8)
AND (
	rp.verify_status IS NULL
	OR rp.verify_status IN (0, 1)
)
AND (
	rp.repair_type IS NULL
	OR rp.repair_type IN (1)
)
AND date(r.create_date) = date(CURDATE());

SELECT
	todayRepairRecords,
	todayMaintenancePlanRecords,
	innerAuditRecords,
	outterAuditRecords,
	inRepairRecords,
	waitVerifyRecords;


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for queryHomePageRemind
-- ----------------------------
DROP PROCEDURE IF EXISTS `queryHomePageRemind`;
DELIMITER ;;
CREATE  PROCEDURE `queryHomePageRemind`(
	IN company_uuid_ VARCHAR (17),
	IN login_uuid_ VARCHAR (17)
)
BEGIN
	DECLARE
		todayRepairRecords,
		thisMonthRepairPlanRecords,
		todayMaintenancePlanRecords,
		thisMonthMaintenancePlanRecords,
		purchaseBillsRecords,
		allocateBillsRecords,
		changeStatusRecords INT DEFAULT 0;

-- 今日维修计划条数
SELECT
	count(*) INTO todayRepairRecords
FROM
	repair_plan r
LEFT JOIN device d ON d.uuid = r.device_uuid
LEFT JOIN department de ON d.using_department_uuid = de.uuid
LEFT JOIN repair_level rl ON rl.uuid = r.repair_level_uuid
LEFT JOIN maintenance_group mg ON mg.uuid = r.maintenance_group_uuid
LEFT JOIN user u ON r.create_By = u.uuid
LEFT JOIN device_type dt ON dt.uuid = d.device_type_uuid
WHERE
	r.is_delete = FALSE
AND r.company_uuid = company_uuid_
AND r.is_excuted = FALSE
AND r.plan_repair_date = (SELECT CURDATE())
AND r.end_date >= r.plan_repair_date
AND r.end_date >= (SELECT CURDATE());

-- 本周维修计划条数
SELECT
	count(*) INTO thisMonthRepairPlanRecords
FROM
	repair_plan r
LEFT JOIN device d ON d.uuid = r.device_uuid
LEFT JOIN department de ON d.using_department_uuid = de.uuid
LEFT JOIN repair_level rl ON rl.uuid = r.repair_level_uuid
LEFT JOIN maintenance_group mg ON mg.uuid = r.maintenance_group_uuid
LEFT JOIN user u ON r.create_By = u.uuid
LEFT JOIN device_type dt ON dt.uuid = d.device_type_uuid
WHERE
	r.is_delete = FALSE
AND r.company_uuid = company_uuid_
AND r.is_excuted = FALSE
AND r.plan_repair_date <= (
	SELECT
		DATE_SUB(
			CURDATE(),
			INTERVAL - (6 - WEEKDAY(CURDATE())) DAY
		)
)
AND r.plan_repair_date >= (
	SELECT
		DATE_SUB(
			CURDATE(),
			INTERVAL WEEKDAY(CURDATE()) DAY
		)
)
AND r.end_date >= (SELECT CURDATE());

-- 今日保养计划
SELECT
	count(*) INTO todayMaintenancePlanRecords
FROM
	maintenance_plan mp
LEFT JOIN device de ON mp.device_uuid = de.uuid
LEFT JOIN department dp ON de.using_department_uuid = dp.uuid
LEFT JOIN maintenance_level ml ON ml.uuid = mp.maintenance_level_uuid
LEFT JOIN maintenance_group mg ON mg.uuid = mp.maintenance_group_uuid
LEFT JOIN user u ON u.uuid = mp.create_by
LEFT JOIN device_type dt ON dt.uuid = de.device_type_uuid
WHERE
	mp.is_delete = FALSE
AND mp.company_uuid = company_uuid_
AND mp.is_excuted = FALSE
AND mp.plan_maintenance_date = (SELECT CURDATE())
AND mp.end_date >= (SELECT CURDATE());

-- 本周保养计划
SELECT
	count(*) INTO thisMonthMaintenancePlanRecords
FROM
	maintenance_plan mp
LEFT JOIN device de ON mp.device_uuid = de.uuid
LEFT JOIN department dp ON de.using_department_uuid = dp.uuid
LEFT JOIN maintenance_level ml ON ml.uuid = mp.maintenance_level_uuid
LEFT JOIN maintenance_group mg ON mg.uuid = mp.maintenance_group_uuid
LEFT JOIN user u ON u.uuid = mp.create_by
LEFT JOIN device_type dt ON dt.uuid = de.device_type_uuid
WHERE
	mp.is_delete = FALSE
AND mp.company_uuid = company_uuid_
AND mp.is_excuted = FALSE
AND mp.plan_maintenance_date <= (
	SELECT
		DATE_SUB(
			CURDATE(),
			INTERVAL - (6 - WEEKDAY(CURDATE())) DAY
		)
)
AND mp.plan_maintenance_date >= (
	SELECT
		DATE_SUB(
			CURDATE(),
			INTERVAL WEEKDAY(CURDATE()) DAY
		)
)
AND mp.end_date >= (SELECT CURDATE());

-- 设备购置待我审核
SELECT
	count(1) INTO purchaseBillsRecords
FROM
	purchase_bills
LEFT JOIN department ON purchase_bills.department_uuid = department.uuid
LEFT JOIN user AS user_apply ON purchase_bills.apply_by = user_apply.uuid
LEFT JOIN user AS user_verify ON purchase_bills.verify_by = user_verify.uuid
LEFT JOIN business_unit AS vendor ON vendor.uuid = purchase_bills.vendor_uuid
LEFT JOIN business_unit AS provider ON provider.uuid = purchase_bills.provider_uuid
INNER JOIN (
	SELECT
		new.uuid,
		new.groups_uuid,

	IF (
		COUNT(new.uuid) = 1,

	IF (new.uuid, 1, 0),
	COUNT(new.uuid)
	) AS count
	FROM
		(
			SELECT
				purchase_bills.uuid,
				purchase_bills_audit.groups_uuid
			FROM
				purchase_bills
			LEFT JOIN purchase_bills_audit ON purchase_bills.uuid = purchase_bills_audit.purchase_bills_uuid
			AND purchase_bills_audit.groups_uuid IN (
				SELECT DISTINCT
					ug.group_uuid
				FROM
					user_group ug
				WHERE
					ug.user_uuid = login_uuid_
				AND ug.group_uuid IN (
					SELECT
						groups_uuid
					FROM
						(
							(
								SELECT
									w.outer_repaire_id1 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
							UNION
								(
									SELECT
										w.outer_repaire_id2 AS groups_uuid
									FROM
										work_flow w
									WHERE
										w.company_uuid = company_uuid_
								)
							UNION
								(
									SELECT
										w.outer_repaire_id3 AS groups_uuid
									FROM
										work_flow w
									WHERE
										w.company_uuid = company_uuid_
								)
							UNION
								(
									SELECT
										w.outer_repaire_id4 AS groups_uuid
									FROM
										work_flow w
									WHERE
										w.company_uuid = company_uuid_
								)
						) groups_uuids
				)
			)
		) AS new
	GROUP BY
		new.uuid
	HAVING
		count < (
			SELECT
				count(1)
			FROM
				user_group ug
			WHERE
				ug.user_uuid = login_uuid_
			AND ug.group_uuid IN (
				SELECT
					groups_uuid
				FROM
					(
						(
							SELECT
								w.outer_repaire_id1 AS groups_uuid
							FROM
								work_flow w
							WHERE
								w.company_uuid = company_uuid_
						)
						UNION
							(
								SELECT
									w.outer_repaire_id2 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
						UNION
							(
								SELECT
									w.outer_repaire_id3 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
						UNION
							(
								SELECT
									w.outer_repaire_id4 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
					) groups_uuids
			)
		)
) AS not_finish ON purchase_bills.uuid = not_finish.uuid
WHERE
	purchase_bills.company_uuid = company_uuid_
AND purchase_bills.is_delete = FALSE
AND (
	purchase_bills.audit_status = 0
	OR purchase_bills.audit_status = 1
);
-- 设备调拨待我审核
SELECT
	count(1) INTO allocateBillsRecords
FROM
	allocate_bills
LEFT JOIN device ON device.uuid = allocate_bills.device_uuid
LEFT JOIN department AS device_department ON device_department.uuid = device.using_department_uuid
LEFT JOIN user AS apply_user ON apply_user.uuid = allocate_bills.apply_by
LEFT JOIN department AS allocateDepartment ON allocateDepartment.uuid = allocate_bills.allocate_department_uuid
LEFT JOIN user AS originalPrincipalUser ON originalPrincipalUser.uuid = allocate_bills.original_principal
INNER JOIN (
	SELECT
		new.uuid,
		new.groups_uuid,

	IF (
		COUNT(new.uuid) = 1,

	IF (new.groups_uuid, 1, 0),
	COUNT(new.uuid)
	) AS count
	FROM
		(
			SELECT
				ab.uuid,
				aba.groups_uuid
			FROM
				allocate_bills ab
			LEFT JOIN allocate_bills_audit aba ON ab.uuid = aba.allocate_bills_uuid
			AND aba.groups_uuid IN (
				SELECT DISTINCT
					ug.group_uuid
				FROM
					user_group ug
				WHERE
					ug.user_uuid = login_uuid_
				AND ug.group_uuid IN (
					SELECT
						groups_uuid
					FROM
						(
							(
								SELECT
									w.device_transfer_id1 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
							UNION
								(
									SELECT
										w.device_transfer_id2 AS groups_uuid
									FROM
										work_flow w
									WHERE
										w.company_uuid = company_uuid_
								)
							UNION
								(
									SELECT
										w.device_transfer_id3 AS groups_uuid
									FROM
										work_flow w
									WHERE
										w.company_uuid = company_uuid_
								)
							UNION
								(
									SELECT
										w.device_transfer_id4 AS groups_uuid
									FROM
										work_flow w
									WHERE
										w.company_uuid = company_uuid_
								)
						) groups_uuids
				)
			)
		) AS new
	GROUP BY
		new.uuid
	HAVING
		count < (
			SELECT DISTINCT
				count(1)
			FROM
				user_group ug
			WHERE
				ug.user_uuid = login_uuid_
			AND ug.group_uuid IN (
				SELECT
					groups_uuid
				FROM
					(
						(
							SELECT
								w.device_transfer_id1 AS groups_uuid
							FROM
								work_flow w
							WHERE
								w.company_uuid = company_uuid_
						)
						UNION
							(
								SELECT
									w.device_transfer_id2 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
						UNION
							(
								SELECT
									w.device_transfer_id3 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
						UNION
							(
								SELECT
									w.device_transfer_id4 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
					) groups_uuids
			)
		)
) AS not_finish ON allocate_bills.uuid = not_finish.uuid
WHERE
	allocate_bills.company_uuid = company_uuid_
AND allocate_bills.is_delete = FALSE
AND (
	DATE(allocate_bills.create_date) >= DATE(allocate_bills.create_date)
)
AND allocate_bills.audit_status IN (0, 1);
-- 改变设备状态 待我审核
SELECT
	count(1) INTO changeStatusRecords
FROM
	change_status
LEFT JOIN (
	SELECT
		device.uuid,
		device.device_name,
		device.device_no,
		device.standard,
		department.department_name,
		user.name
	FROM
		device
	LEFT JOIN department ON device.using_department_uuid = department.uuid
	LEFT JOIN user ON device.property_principal_uuid = user.uuid
	WHERE
		device.company_uuid = company_uuid_
) AS new_device ON new_device.uuid = change_status.device_uuid
LEFT JOIN user AS apply_user ON change_status.create_by = apply_user.uuid
INNER JOIN (
	SELECT
		new.uuid,
		new.groups_uuid,
		IF (
		COUNT(new.uuid) = 1,

	IF (new.groups_uuid, 1, 0),
	COUNT(new.uuid)
	) AS count
	FROM
		(
			SELECT
				c_status.uuid,
				cs_audit.groups_uuid
			FROM
				change_status c_status
			LEFT JOIN change_status_audit cs_audit ON c_status.uuid = cs_audit.change_status_uuid
			AND cs_audit.groups_uuid IN (
				SELECT DISTINCT
					ug.group_uuid
				FROM
					user_group ug
				WHERE
					ug.user_uuid = login_uuid_
				AND ug.group_uuid IN (
					SELECT
						groups_uuid
					FROM
						(
							(
								SELECT
									w.change_status_id1 AS groups_uuid
								FROM
									work_flow w
								WHERE
									w.company_uuid = company_uuid_
							)
							UNION
								(
									SELECT
										w.change_status_id2 AS groups_uuid
									FROM
										work_flow w
									WHERE
										w.company_uuid = company_uuid_
								)
							UNION
								(
									SELECT
										w.change_status_id3 AS groups_uuid
									FROM
										work_flow w
									WHERE
										w.company_uuid = company_uuid_
								)
							UNION
								(
									SELECT
										w.change_status_id4 AS groups_uuid
									FROM
										work_flow w
									WHERE
										w.company_uuid = company_uuid_
								)
						) groups_uuids
				)
			)
		) AS new
	GROUP BY
		new.uuid
	HAVING
		count < (
			SELECT
				count(1)
			FROM
				(
					(
						SELECT
							w.change_status_id1 AS groups_uuid
						FROM
							work_flow w
						WHERE
							w.company_uuid = company_uuid_
					)
					UNION
						(
							SELECT
								w.change_status_id2 AS groups_uuid
							FROM
								work_flow w
							WHERE
								w.company_uuid = company_uuid_
						)
					UNION
						(
							SELECT
								w.change_status_id3 AS groups_uuid
							FROM
								work_flow w
							WHERE
								w.company_uuid = company_uuid_
						)
					UNION
						(
							SELECT
								w.change_status_id4 AS groups_uuid
							FROM
								work_flow w
							WHERE
								w.company_uuid = company_uuid_
						)
				) AS groups_uuids
		)
) AS not_finish ON change_status.uuid = not_finish.uuid
WHERE
	change_status.company_uuid = company_uuid_
AND change_status.is_delete = FALSE
AND change_status.audit_status IN (0, 1);

SELECT
	todayRepairRecords,
	thisMonthRepairPlanRecords,
	todayMaintenancePlanRecords,
	thisMonthMaintenancePlanRecords,
	purchaseBillsRecords,
	allocateBillsRecords,
	changeStatusRecords;


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for query_device_repair_report
-- ----------------------------
DROP PROCEDURE IF EXISTS `query_device_repair_report`;
DELIMITER ;;
CREATE  PROCEDURE `query_device_repair_report`(
    IN company_uuid_ VARCHAR (17),
    IN start_date_ VARCHAR (17),
    IN end_date_ VARCHAR (17),
    IN department_uuid_ VARCHAR (17)
)
BEGIN
    CREATE TEMPORARY TABLE
IF NOT EXISTS repair_temp (
    device_no VARCHAR (17),
    device_name VARCHAR (17),
    standard VARCHAR (17),
    department_name VARCHAR (17),
    repair_levels VARCHAR (100),
    fault_days VARCHAR (17),
    stop_time VARCHAR (17),
    repair_total_times VARCHAR (17),
    repair_cost VARCHAR (17),
    repair_time VARCHAR (17)
);



BEGIN
    DECLARE
        -- 接收游标数据的变量
        device_uuid,
        device_no,
        device_name,
        standard,
        department_name VARCHAR (17) DEFAULT '';

-- 遍历游标结束标志
DECLARE
    done INT DEFAULT FALSE;

/* 故障天数 */
/* 维修次数分类统计 */
DECLARE
    no_department_device_uuid_cursor CURSOR FOR SELECT
        d.uuid,
        d.device_no,
        d.device_name,
        d.standard,
        dep.department_name
    FROM
        device d
    LEFT JOIN department dep ON d.using_department_uuid = dep.uuid;
DECLARE
    device_uuid_cursor CURSOR FOR SELECT
        d.uuid,
        d.device_no,
        d.device_name,
        d.standard,
        dep.department_name
    FROM
        device d
    LEFT JOIN department dep ON d.using_department_uuid = dep.uuid
		WHERE FIND_IN_SET(d.using_department_uuid ,(SELECT queryDepartmentChildren(department_uuid_)));

DECLARE
    CONTINUE HANDLER FOR NOT FOUND
SET done = TRUE;

IF department_uuid_ = '' THEN
  OPEN no_department_device_uuid_cursor;
ELSE 
  OPEN device_uuid_cursor;
END IF;

REPEAT
	IF department_uuid_  = '' THEN
		FETCH no_department_device_uuid_cursor INTO device_uuid,
		device_no,
    device_name,
    standard,
    department_name;
	ELSE 
		FETCH device_uuid_cursor INTO device_uuid,
		device_no,
    device_name,
    standard,
    department_name;
	END IF;

IF NOT done THEN
CALL query_repair_level (
    device_no,
    device_name,
    standard,
    department_name,
    device_uuid,
    company_uuid_,
    start_date_,
    end_date_
);

END IF;
UNTIL done=true
END
REPEAT
;

END;

SELECT
    device_no,
    device_name,
    standard,
    department_name,
    repair_levels,
    fault_days,
    stop_time,
    repair_total_times,
    repair_cost,
    repair_time
FROM
    repair_temp;

TRUNCATE TABLE repair_temp;


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for query_maintenance_count_by_maintenance_level
-- ----------------------------
DROP PROCEDURE IF EXISTS `query_maintenance_count_by_maintenance_level`;
DELIMITER ;;
CREATE  PROCEDURE `query_maintenance_count_by_maintenance_level`(
in startTime VARCHAR(25),
in stopTime VARCHAR(25),
in departmentUuid VARCHAR(25),
in companyUuid VARCHAR(25))
begin
    DECLARE end_flag INT(1) DEFAULT 0; -- 游标结束标记
  DECLARE department_uuid_ varchar(20);
  DECLARE department_name_ varchar(35);
  DECLARE total_ int(11); -- 合计次数
  DECLARE maintenance_price_ DECIMAL(18,2);  -- 合计修费用
    DECLARE stop_time_ DECIMAL(18,2);  -- 合计停机时间
  DECLARE maintenance_time_ DECIMAL(18,2); -- 合计维修用时
  DECLARE item_count_ VARCHAR(80);

  -- 游标用于按部门合计维修总次数，总用时等
    DECLARE  cur_maintenance_count_by_department CURSOR FOR SELECT dp.uuid department_uuid,dp.department_name,count(mr.uuid) total,sum(mr.maintenance_price) maintenance_price_,SUM(mr.stop_time) stop_time,SUM(mr.maintenance_time) maintenance_time from department dp
LEFT JOIN device d on dp.uuid=d.using_department_uuid
LEFT JOIN maintenance_record mr on mr.device_uuid=d.uuid 
and DATE_FORMAT(mr.create_date,"%Y-%m-%d")>=DATE_FORMAT(DATE(startTime),"%Y-%m-%d") and DATE_FORMAT(mr.create_date,"%Y-%m-%d")<=DATE_FORMAT(DATE(stopTime),"%Y-%m-%d")
where dp.is_delete=FALSE and dp.company_uuid=companyUuid AND 
IF(departmentUuid ,dp.uuid=departmentUuid,"1=1")
group by dp.uuid; 
DECLARE  CONTINUE HANDLER FOR NOT FOUND SET end_flag = 1;
    IF startTime IS NOT NULL
    THEN
-- 创建临时表 
drop TABLE if exists tmp; CREATE TEMPORARY TABLE tmp (
    uuid VARCHAR(20) NOT NULL,
    count INTEGER NOT NULL
  );
-- 外层临时表
drop TABLE if exists out_temp; CREATE TABLE out_temp (
   department_uuid varchar(20),
   department_name varchar(35),
   total int(11),-- 合计次数
   maintenance_price DECIMAL(18,2),  -- 合计修费用
     stop_time DECIMAL(18,2),  -- 合计停机时间
   maintenance_time DECIMAL(18,2), -- 合计维修用时
   item_count VARCHAR(80)
  );
    OPEN cur_maintenance_count_by_department;
    REPEAT    
      FETCH cur_maintenance_count_by_department INTO department_uuid_, department_name_,total_,maintenance_price_,stop_time_,maintenance_time_;
             IF end_flag!=1
             THEN
       "1" uuid,COUNT(d.using_department_uuid) count from 
        maintenance_level ml left JOIN maintenance_record mr ON mr.maintenance_level_uuid=ml.uuid  and DATE_FORMAT(mr.create_date,"%Y-%d-%m")>=DATE_FORMAT(startTime,"%Y-%d-%m") and DATE_FORMAT(mr.create_date,"%Y-%d-%m")<=DATE_FORMAT(stopTime,"%Y-%d-%m")
                LEFT JOIN device d ON mr.device_uuid=d.uuid and d.using_department_uuid=department_uuid_
                where ml.is_delete=FALSE and ml.company_uuid=companyUuid
        GROUP BY ml.uuid order by ml.create_date DESC;
        SELECT GROUP_CONCAT(t.count) into item_count_ from tmp t group by t.uuid;
        TRUNCATE TABLE tmp;
             END IF;
    UNTIL end_flag = 1
        END REPEAT;
    close cur_maintenance_count_by_department;
  DROP TABLE tmp; 
  SELECT department_uuid, department_name,total,maintenance_price,stop_time,maintenance_time,item_count FROM out_temp;
  TRUNCATE TABLE out_temp;
END IF;
    end
;;
DELIMITER ;

