DELIMITER ;

-- ----------------------------
-- Procedure structure for query_repair_count_failure_type
-- ----------------------------
DROP PROCEDURE IF EXISTS `query_repair_count_failure_type`;
DELIMITER ;;
CREATE  PROCEDURE `query_repair_count_failure_type`(
in startTime VARCHAR(25),
in stopTime VARCHAR(25),
in departmentUuid VARCHAR(25),
in companyUuid VARCHAR(25))
begin
    DECLARE end_flag INT(1) DEFAULT 0; -- 游标结束标记
  DECLARE department_uuid_ varchar(20);
  DECLARE department_name_ varchar(35);
  DECLARE total_ int(11); -- 合计次数
  DECLARE repair_cost_ DECIMAL(18,2);  -- 合计修费用
    DECLARE stop_time_ DECIMAL(18,2);  -- 合计停机时间
  DECLARE repair_time_ DECIMAL(18,2); -- 合计维修用时
  DECLARE item_count_ VARCHAR(80) DEFAULT "";
    DECLARE oneFailureType VARCHAR(50); -- 第一级id
    DECLARE manyFilureType varchar(5000); -- 某级别下所有的id
    DECLARE oneMount int ; -- 第一级个数
    DECLARE oneLevelCur CURSOR for select ft.uuid from failure_type ft where ft.is_delete=false and ft.level=1 order by ft.sequence asc; -- 第一级故障类别游标
  -- 游标用于按部门合计维修总次数，总用时等
    DECLARE  cur_repair_count_by_department CURSOR FOR select d.uuid department_uuid,d.department_name,count(r.uuid) total,sum(r.repair_cost) repair_cost,sum(r.stop_time) stop_time,sum(r.repair_time) repair_time from department d LEFT JOIN device dev ON d.uuid=dev.using_department_uuid LEFT JOIN repair_bills r ON r.device_uuid=dev.uuid 
    and DATE_FORMAT(r.create_date,"%Y-%m-%d")>=DATE_FORMAT(DATE(startTime),"%Y-%m-%d") and DATE_FORMAT(r.create_date,"%Y-%m-%d")<=DATE_FORMAT(DATE(stopTime),"%Y-%m-%d")
    where d.is_delete=FALSE and d.company_uuid=companyUuid AND 
    IF(departmentUuid ,d.uuid=departmentUuid,"1=1")
    group by d.uuid; 
    DECLARE  CONTINUE HANDLER FOR NOT FOUND SET end_flag = 1;
    IF startTime IS NOT NULL
    THEN
-- 外层临时表
    drop TABLE if exists out_temp; CREATE TABLE out_temp (
   department_uuid varchar(20),
   department_name varchar(35),
   total int(11),-- 合计次数
   repair_cost DECIMAL(18,2),  -- 合计修费用
     stop_time DECIMAL(18,2),  -- 合计停机时间
   repair_time DECIMAL(18,2), -- 合计维修用时
   item_count VARCHAR(80)
  );
    OPEN cur_repair_count_by_department;
    REPEAT    
      FETCH cur_repair_count_by_department INTO department_uuid_, department_name_,total_,repair_cost_,stop_time_,repair_time_;
             IF end_flag!=1
             THEN
                                    OPEN oneLevelCur;
                                    REPEAT
                                    FETCH oneLevelCur INTO oneFailureType;
                                    IF end_flag!=1
                                    THEN
                                    SELECT count(*) INTO oneMount from repair_bills rb LEFT JOIN device d on d.uuid=rb.device_uuid
                                    where FIND_IN_SET(rb.failure_type_uuid,(select query_child_failure_type(oneFailureType))) and d.using_department_uuid=department_uuid_ 
                                    AND DATE_FORMAT(rb.create_date,"%Y-%m-%d")>=DATE_FORMAT(DATE(startTime),"%Y-%m-%d") and DATE_FORMAT(rb.create_date,"%Y-%m-%d")<=DATE_FORMAT(DATE(stopTime),"%Y-%m-%d") 
                                    and rb.is_delete=FALSE ;
                                    SET item_count_=CONCAT(item_count_,",",oneMount);
                                    END IF;
                                    UNTIL end_flag=1
                                    END REPEAT;
                    SET end_flag=0;
                    CLOSE oneLevelCur;
                    SET item_count_="";
             END IF;
                UNTIL end_flag = 1
        END REPEAT;
    close cur_repair_count_by_department;
  -- SELECT department_uuid, department_name,total,repair_cost,stop_time,repair_time,item_count FROM out_temp;
  SELECT department_uuid, department_name,total,repair_cost,stop_time,repair_time,item_count FROM out_temp;
  TRUNCATE TABLE out_temp;
END IF;
    end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for query_repair_level
-- ----------------------------
DROP PROCEDURE IF EXISTS `query_repair_level`;
DELIMITER ;;
CREATE  PROCEDURE `query_repair_level`(
    IN device_no_ VARCHAR (17),
    IN device_name_ VARCHAR (17),
    IN standard_ VARCHAR (17),
    IN department_name_ VARCHAR (17),
    IN device_uuid_ VARCHAR (17),
    IN company_uuid_ VARCHAR (17),
    IN start_date_ VARCHAR (17),
    IN end_date_ VARCHAR (17)
)
BEGIN
    DECLARE
        -- 故障天数,故障停机小时,维修总次数，维修费用，维修用时，
        fault_days,
        stop_time,
        repair_total_times,
        repair_cost,
        repair_time DECIMAL (18, 2) DEFAULT 0;

DECLARE
    -- 接收游标数据的变量
    repair_level_uuid VARCHAR (17) DEFAULT '';

-- 返回repair_levels
DECLARE
    repair_levels VARCHAR (250) DEFAULT '';
-- repair_level_counts
DECLARE
    repair_level_counts INT (25) DEFAULT 0;

-- 遍历游标结束标志
DECLARE
    done INT DEFAULT FALSE;

/* 故障天数 */
/* 维修次数分类统计 */
DECLARE
    repair_level_uuid_cursor CURSOR FOR SELECT
        rl.uuid
    FROM
        repair_level rl WHERE rl.company_uuid=company_uuid_ AND rl.is_delete=FALSE order by rl.create_date desc;

DECLARE
    CONTINUE HANDLER FOR NOT FOUND
SET done = TRUE;

OPEN repair_level_uuid_cursor;


REPEAT
    FETCH repair_level_uuid_cursor INTO repair_level_uuid;

SELECT
    COUNT(*) INTO repair_level_counts
FROM
    repair_bills rb
WHERE
    rb.repair_level_uuid = repair_level_uuid
		AND rb.device_uuid=device_uuid_
		AND rb.repair_status = 8;


SET repair_levels = CONCAT(
    repair_levels,
    ',',
    repair_level_counts
);

UNTIL done
END
REPEAT
;

SELECT
    SUM(
        CEILING(

            IF (


date(rb.repair_start_date) >= date(end_date_)
OR date(rb.repair_end_date) <= date(start_date_),

                0,
                TIMESTAMPDIFF(
                    HOUR,

                IF (
                    date(rb.repair_start_date) > date(start_date_),
                    date(rb.repair_start_date),
                    date(start_date_)
                ),

            IF (
                date(rb.repair_end_date) > date(end_date_),
                date(end_date_),
                date(rb.repair_end_date)
            )
                ) / 24
            )
        )
    ) INTO fault_days
FROM
    repair_bills rb
LEFT JOIN device d ON rb.device_uuid = d.uuid
WHERE
    rb.repair_status = 8
AND rb.device_uuid = device_uuid_
AND rb.company_uuid = company_uuid_
AND date(rb.create_date) BETWEEN date(start_date_)
AND date(end_date_);

/* 故障停机小时 */
SELECT
    SUM(rb.stop_time) INTO stop_time
FROM
    repair_bills rb
LEFT JOIN device d ON rb.device_uuid = d.uuid
WHERE
    rb.device_uuid = device_uuid_
AND rb.company_uuid = company_uuid_
AND date(rb.create_date) BETWEEN date(start_date_)
AND date(end_date_)
AND rb.repair_status = 8;

/* 维修总次数 */
SELECT
    count(*) INTO repair_total_times
FROM
    repair_bills rb
LEFT JOIN device d ON rb.device_uuid = d.uuid
WHERE
    rb.repair_status = 8
AND rb.device_uuid = device_uuid_
AND rb.company_uuid = company_uuid_
AND date(rb.create_date) BETWEEN date(start_date_)
AND date(end_date_);

/* 维修费用 */
SELECT
    SUM(rb.repair_cost) INTO repair_cost
FROM
    repair_bills rb
LEFT JOIN device d ON rb.device_uuid = d.uuid
WHERE
    rb.repair_status = 8
AND rb.device_uuid = device_uuid_
AND rb.company_uuid = company_uuid_
AND date(rb.create_date) BETWEEN date(start_date_)
AND date(end_date_);

/* 维修用时 */
SELECT
    SUM(rb.repair_time) INTO repair_time
FROM
    repair_bills rb
LEFT JOIN device d ON rb.device_uuid = d.uuid
WHERE
    rb.repair_status = 8
AND rb.device_uuid = device_uuid_
AND rb.company_uuid = company_uuid_
AND date(rb.create_date) BETWEEN date(start_date_)
AND date(end_date_);

    device_no,
    device_name,
    standard,
    department_name,
    repair_levels,
    fault_days,
    stop_time,
    repair_total_times,
    repair_cost,
    repair_time
)
VALUES
    (
        device_no_,
        device_name_,
        standard_,
        department_name_,
        repair_levels,
        fault_days,
        stop_time,
        repair_total_times,
        repair_cost,
        repair_time
    );

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for repair_bi
-- ----------------------------
DROP PROCEDURE IF EXISTS `repair_bi`;
DELIMITER ;;
CREATE  PROCEDURE `repair_bi`()
BEGIN
DECLARE s INT DEFAULT 0;
DECLARE b varchar(4000);
DECLARE uuid varchar(17);
DECLARE departmentName varchar(17);
DECLARE mount int(17);
DECLARE rapairCost DECIMAL;
DECLARE repairTime DECIMAL;
DECLARE stopTime DECIMAL;
DECLARE repair_bi_curs CURSOR FOR select dep.uuid,dep.department_name, count(*),count(rb.repair_cost),
count(rb.stop_time),count(rb.repair_time)
from department dep
left join device de on de.using_department_uuid=dep.uuid
LEFT JOIN repair_bills rb on rb.device_uuid=de.uuid
where dep.is_delete=FALSE GROUP BY dep.uuid;
	DECLARE  CONTINUE HANDLER FOR NOT FOUND  SET  s = 1;
OPEN repair_bi_curs;
set b="{";
REPEAT
	FETCH repair_bi_curs into uuid,departmentName,mount,rapairCost,stopTime,repairTime;
	SET b=CONCAT(b,"'uuid'",uuid,"'departmentName'",departmentName,"'mount'",mount,"'rapairCost'",rapairCost,"'stopTime'",stopTime,"'repairTime'",repairTime);
	UNTIL s=1
	END REPEAT;
set b=CONCAT(b,"}");
CLOSE repair_bi_curs;
SELECT b;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for repair_year_plan
-- ----------------------------
DROP PROCEDURE IF EXISTS `repair_year_plan`;
DELIMITER ;;
CREATE  PROCEDURE `repair_year_plan`(IN planYear INTEGER(25),IN repairLevelUuid VARCHAR(25),IN departmentUuid VARCHAR(25),IN companyUuid VARCHAR(25))
BEGIN
DECLARE repair_plan_uuid_ VARCHAR(25); -- 维修单uuid 
DECLARE device_no_ VARCHAR(40); -- 设备编号
DECLARE device_name_ VARCHAR(40); -- 设备名字
DECLARE standard_ VARCHAR(30); -- 设备型号
DECLARE department_name_ VARCHAR(40); -- 使用部门
DECLARE repair_level_name_ VARCHAR(40); -- 维修等级
DECLARE description_ VARCHAR(40); -- 描述
DECLARE plan_repair_date_ TIMESTAMP; -- 计划维修时间
DECLARE wait_execute_time_ VARCHAR(500) DEFAULT ""; -- 待执行次数 月分布
DECLARE end_flag INT(1) DEFAULT 0; -- 游标结束标记
DECLARE loops_period_type_ INT(1);  -- 循环周期方式 年 月 日
DECLARE loops_period_ INT(1); -- 循环周期
DECLARE loops_type_ BIGINT(1); -- 循环方式
DECLARE n INT(10) DEFAULT 1; -- 循环下标
DECLARE frequence INT(10) DEFAULT 0; -- 次数
DECLARE plan_repair_date_temp TIMESTAMP; -- 计划保养时间临时变量
DECLARE nextMonth INT(10) DEFAULT 0; -- 下个月
DECLARE endDate TIMESTAMP; -- 终止时间
DECLARE plan_year_month VARCHAR(80);-- 查询日期字符串
DECLARE plan_year_month_date VARCHAR(30); -- 查询日期
DECLARE repair_cursor CURSOR FOR SELECT d.uuid,d.device_no,d.device_name,d.standard,dep.department_name,rl.repair_level,rpl.description,rpl.plan_repair_date,
rpl.loops_period_type,rpl.loops_period,rpl.loops_type,rpl.end_date
from repair_plan rpl
LEFT JOIN device d on d.uuid=rpl.device_uuid
LEFT JOIN department dep ON dep.uuid=d.using_department_uuid
LEFT JOIN repair_level rl ON rl.uuid=rpl.repair_level_uuid
where rpl.is_excuted=FALSE and rpl.is_delete=FALSE 
and IF(repairLevelUuid,rpl.repair_level_uuid=repairLevelUuid,"1=1") 
and IF(departmentUuid,dep.uuid=departmentUuid,"1=1")
and rpl.company_uuid=companyUuid ORDER BY rpl.create_date ASC;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_flag=1;
-- 用于存放所有记录的临时表
drop TABLE IF EXISTS all_repair_plan;
create TEMPORARY TABLE all_repair_plan(
 device_no VARCHAR(40), -- 设备编号
 device_name VARCHAR(40), -- 设备名字
 standard VARCHAR(30), -- 设备型号
 department_name VARCHAR(40), -- 使用部门
 repair_level_name VARCHAR(40), -- 维修等级
 description VARCHAR(40), -- 描述
 plan_repair_date TIMESTAMP, -- 计划保养时间
 wait_execute_time VARCHAR(500) -- 待执行次数 月分布
);
IF planYear IS NOT NULL
THEN
OPEN repair_cursor;
REPEAT
FETCH repair_cursor INTO repair_plan_uuid_,device_no_,device_name_,standard_,department_name_,repair_level_name_,
description_,plan_repair_date_,loops_period_type_,loops_period_,loops_type_,endDate;
SET plan_repair_date_temp=plan_repair_date_;
SET plan_year_month=planYear;
IF end_flag!=1
THEN
		IF loops_type_=1 -- 单次循环
		THEN
			SET n=0;-- 循环下标
			while n<12
			DO
				IF planYear!=DATE_FORMAT(plan_repair_date_,"%Y")
				THEN
					SET wait_execute_time_=CONCAT(wait_execute_time_,",",0);
				ELSE
					IF DATE_FORMAT(plan_repair_date_,"%m")!=n 
					THEN
						SET wait_execute_time_=CONCAT(wait_execute_time_,",",0);
					ELSE
						IF DATE_FORMAT(plan_repair_date_,"%Y-%m-%d")<CURDATE()
						THEN 
							SET wait_execute_time_=CONCAT(wait_execute_time_,",",0);
						ELSE 
							SET wait_execute_time_=CONCAT(wait_execute_time_,",",1);
						END IF;
					END IF;
				END IF;
				SET n=n+1;
			END WHILE;
	 ELSE  -- 多次循环
				
			 set n=1;
			 WHILE n<=12
			 DO
			 SET plan_year_month=CONCAT(planYear,"-",n,"-","01");
			 set plan_year_month_date=DATE_FORMAT(DATE(plan_year_month),"%Y-%m");
			 IF  plan_year_month_date<DATE_FORMAT(DATE(plan_repair_date_),"%Y-%m")-- 还未到计划保养年月
			 THEN 					
					SET wait_execute_time_=CONCAT(wait_execute_time_,",",0);
			 ELSE  -- 到计划保养年月
								SET nextMonth=n;
								SET frequence=0;	
								CASE 
								WHEN loops_period_type_=1 -- 天
										THEN
											WHILE planYear!=YEAR(plan_repair_date_temp)
											DO
											SET	plan_repair_date_temp=DATE_ADD(plan_repair_date_temp,INTERVAL loops_period_ DAY);-- 跳转到查询那一年
											END WHILE;
										WHILE nextMonth=n -- 未达到月底
										DO
											IF DATE_FORMAT(plan_repair_date_temp,"%Y-%m-%d")<CURDATE() -- 计划保养时间已经过期
											THEN
											SET	plan_repair_date_temp=DATE_ADD(plan_repair_date_temp,INTERVAL loops_period_ DAY);
											set nextMonth=MONTH(plan_repair_date_temp);
											ELSE
												IF	plan_repair_date_temp<=endDate AND YEAR(plan_repair_date_temp)=planYear -- 计划保养临时时间小于终止时间
												THEN
													SET frequence=frequence+1;
												END IF;
													 SET	plan_repair_date_temp=DATE_ADD(plan_repair_date_temp,INTERVAL loops_period_ DAY);
													set nextMonth=MONTH(plan_repair_date_temp);
											END IF;
										END WHILE;
								 WHEN loops_period_type_=2 -- 月
											THEN
											WHILE planYear!=YEAR(plan_repair_date_temp)
											DO
											SET	plan_repair_date_temp=DATE_ADD(plan_repair_date_temp,INTERVAL loops_period_ MONTH);-- 跳转到查询那一年
											END WHILE;
											IF DATE_FORMAT(plan_repair_date_temp,"%Y-%m-%d")<CURDATE() -- 计划保养时间已经过期
											THEN
												SET frequence=0;
												SET plan_repair_date_temp=DATE_ADD(plan_repair_date_temp,INTERVAL loops_period_ MONTH);
											ELSEIF MONTH(plan_repair_date_temp)=n 
											THEN 
												IF	plan_repair_date_temp<=endDate 
												THEN
													SET frequence=1;
												ELSE
													SET frequence=0;
												end IF;
												SET plan_repair_date_temp=DATE_ADD(plan_repair_date_temp,INTERVAL loops_period_ MONTH);
											ELSE
											SET frequence=0;
											END IF;
								 WHEN loops_period_type_=3 -- 年
										then
										WHILE planYear!=YEAR(plan_repair_date_temp)
										DO
										SET	plan_repair_date_temp=DATE_ADD(plan_repair_date_temp,INTERVAL loops_period_ YEAR);-- 跳转到查询那一年
										END WHILE;
										IF DATE_FORMAT(plan_repair_date_temp,"%Y-%m-%d")<CURDATE() -- 计划保养时间已经过期
											THEN
										SET frequence=0;
										ELSE 
												IF	plan_repair_date_temp<=endDate AND MONTH(plan_repair_date_temp)=n
												THEN
													SET frequence=1;
												ELSE
													SET frequence=0;
												END IF;
										END IF;
								END CASE;
						SET wait_execute_time_=CONCAT(wait_execute_time_,",",frequence);
				END IF;
				SET n=n+1;
			 END WHILE;
		END IF;
description_,plan_repair_date_,wait_execute_time_);
SET wait_execute_time_="";
END IF;
UNTIL end_flag=1
END REPEAT;
CLOSE repair_cursor;
END IF;
SELECT * from all_repair_plan;
END
;;
DELIMITER ;

