-- ----------------------------
-- Procedure structure for storageCollect
-- ----------------------------
DROP PROCEDURE IF EXISTS `storageCollect`;
DELIMITER ;;
CREATE  PROCEDURE `storageCollect`(IN companyUuid VARCHAR(17),
    IN peroid decimal(18,2),
    IN beginTime VARCHAR(30),
    IN endTime VARCHAR(30))
begin
    #备件分析统计  按仓库汇总
 create temporary table if not exists storageCollect   -- 创建临时表
      ( 
         storageName VARCHAR(17),
         partsCount float(17),  
         inCount float(17),
         inTotal float(17),
         outCount float(17),
         outTotal float(17),
         checkAddCount float(17),
         checkAddTotal float(17),
         checkSubtractCount float(17),
         checkSubtractTotal float(17)
       ) ENGINE = MEMORY;
BEGIN
        DECLARE storageUuid,storageName VARCHAR(17); -- 单个仓库uuid,name
        DECLARE recordSql,inDateSql,recordUuidArr varchar(4000);    -- 查询记录的sql语句  ,日期查询动态条件   , 条件查询得到的记录表中的uuid 并拼接
        DECLARE s int default 0; -- 表示符，用于游标结束标志
        DECLARE cursor_name CURSOR FOR select uuid,storage_name from storage where is_delete = false and company_uuid=companyUuid and is_delete = false; -- 创建一个游标
        # 当游标结束时 s=1
        DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET s=1; 
        
        SET recordSql = CONCAT('select group_concat(uuid) INTO @recordUuidArr from inventory_record where company_uuid = ',companyUuid);
         
				SET inDateSql = CONCAT(' and DATE(create_date) >=  DATE("',beginTime,'") and DATE(create_date) <= DATE("',endTime,'")');    

        SET recordSql = CONCAT(recordSql,inDateSql);    -- 记录表动态sql
        #预处理记录表，得到需要查询的recordUuid
        set @recordSql = recordSql;
        prepare stmt from @recordSql;
    execute stmt;
        deallocate prepare stmt;
        #给需要的字段赋值
        set recordUuidArr = @recordUuidArr;
        open cursor_name; -- 启动游标
        REPEAT  -- 循环
            #获取游标当前指针的记录，读取一行数据并传值
            fetch  cursor_name into storageUuid,storageName;
            
            #得到仓库下的货品种类个数
            select count(DISTINCT i.parts_uuid) into @partsCount from inventory_record re left join inventory i on i.uuid = re.inventory_uuid where i.storage_uuid = storageUuid;
            #得到此仓库下的出入库金额及个数
            select sum(if(re.type=1,1,0)),sum(if(re.type=1,re.total,0)),sum(if(re.type=2,1,0)),sum(if(re.type=2,re.total,0))into @inCount,@inTotal,@outCount,@outTotal
                from inventory_record re left join inventory i on i.uuid = re.inventory_uuid where i.storage_uuid = storageUuid and find_in_set(re.uuid,recordUuidArr) and (type = 1 or type = 2);
            #得到此仓库下盘点盘盈盘亏金额及个数
            select sum(if(re.is_inbound,1,0)),sum(if(re.is_inbound,re.total,0)),sum(if(re.is_inbound,0,1)),sum(if(re.is_inbound,0,re.total))into @checkAddCount,@checkAddTotal,@checkSubtractCount,@checkSubtractTotal
                from inventory_record re left join inventory i on i.uuid = re.inventory_uuid where i.storage_uuid = @storageUuid and find_in_set(re.uuid,recordUuidArr) and type = 3;

            #想临时表中添加数据
                values (storageName,@partsCount,@inCount,@inTotal,@outCount,@outTotal,@checkAddCount,@checkAddTotal,@checkSubtractCount,@checkSubtractTotal);
            
        UNTIL s END REPEAT;
        CLOSE cursor_name; -- 关闭游标
end;
    select DISTINCT storageName,partsCount,inCount,inTotal,outCount,outTotal,checkAddCount,checkAddTotal,checkSubtractCount,checkSubtractTotal from storageCollect order by partsCount desc;
    truncate TABLE storageCollect; -- 清除临时表数据
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for update_inventory
-- ----------------------------
DROP PROCEDURE IF EXISTS `update_inventory`;
DELIMITER ;;
CREATE  PROCEDURE `update_inventory`(
    IN outStorageuuid varchar(17),
    IN inStorageUuid varchar(17),
    IN partsUuid varchar(17),
    IN companyUuid varchar(17),
    IN storageLocationUuid varchar(17),
    IN fromBillsUuid varchar(17),
    IN count int(10),
    IN price decimal(18,2),
    IN recordType int(10)
)
begin
    -- 移动数量的总价,库位上总量,调出仓库总量,调出总价,调入仓库总量,调入总价
    -- insidePrice 内部价格，由查询出来的表中的 总价/个数
    -- finalPrice 最终价格，根据传进来的price是否null来判断具体数字
    DECLARE totalPrice,locationCount,outinventorycount,outtotalPrice,ininventorycount,intotalPrice,insidePrice,finalPrice decimal(18,2); 
     -- 库位库存uuid,调出库存Uuid,调入库存uuid 
    DECLARE locationUuid,outUuid,inUuid varchar(17);
        -- 查询入库 库存
        select uuid,inventory_count,inventory_total_price into inUuid,ininventorycount,intotalPrice from inventory where storage_uuid = inStorageuuid and parts_uuid =partsUuid and company_uuid = companyUuid;
        -- 查询库位 库存
        select uuid,location_count into locationUuid,locationCount from inventory_location where storage_location_uuid = storageLocationUuid and parts_uuid = partsUuid and company_uuid = companyUuid;
        -- 查询出库 库存
        select uuid,inventory_count,inventory_total_price into outUuid,outinventorycount,outtotalPrice from inventory where storage_uuid = outStorageuuid and parts_uuid =partsUuid and company_uuid = companyUuid;
        if price is NUlL then
            if inUuid is not NULL then -- 需入库的仓库存在库存，以库存单价进行计算，主要有盘点
                set insidePrice = intotalPrice / ininventorycount;
            end if;
            if outUuid is not null then -- 如果存在出库的仓库则以出库时库存单价为准，主要有出库，调拨
                set insidePrice = outtotalPrice / outinventorycount;
            end if;
            set finalPrice = insidePrice; -- 最终使用的价格
        else -- 输入单价不是空
            set finalPrice = price; -- 入库时输入单价,最终使用的价格
        end if;
        set totalPrice = ABS(count) * finalPrice;
        
        if inStorageUuid is not NULL then -- 存在入库
            if inUuid is null THEN -- 入库但之前没有库存
                -- 添加库存字段
                                    values (UUID_SHORT(),partsUuid,inStorageUuid,count,totalPrice,companyUuid,Now(),null,Now(),null);
                -- 得到刚刚添加的字段的uuid
                select uuid into inUuid from inventory where parts_uuid = partsUuid and storage_uuid = inStorageUuid and company_uuid = companyUuid;
            else   
                set ininventorycount = ininventorycount + count; 
                set intotalPrice = intotalPrice + count * finalPrice;
                -- 修改库存
                update inventory set inventory_count = ininventorycount, inventory_total_price = intotalPrice,update_date = now() where uuid = inUuid;
            end if;
            -- 添加记录
                    values (UUID_SHORT(),fromBillsUuid,inUuid,1,if(ininventorycount,ininventorycount,count),ABS(count),finalPrice,totalPrice,recordType,companyUuid,NOW(),null,NOW(),null);
        end if;

        if outStorageuuid is not null THEN -- 存在出库   
            set outinventorycount = outinventorycount - ABS(count);  -- 减去count的绝对值，在盘点时候存在count为负数
            set outtotalPrice = outinventorycount * finalPrice;
            -- 修改库存
            update inventory set inventory_count = outinventorycount, inventory_total_price = outtotalPrice,update_date = now() where uuid = outUuid;
            -- 添加记录
                    values (UUID_SHORT(),fromBillsUuid,outUuid,0,outinventorycount,ABS(count),finalPrice,totalPrice,recordType,companyUuid,NOW(),null,NOW(),null);
        end if;
        case recordType  
                when 1 then  -- 入库
                    if storageLocationUuid is not null and storageLocationUuid != "" and locationUuid is null then -- 只有入库才存在添加库位库存的情况
                        -- 添加库位上的库存
                                                values (UUID_SHORT(),partsUuid,inUuid,storageLocationUuid,count,0,companyUuid,NOW(),null,NOW(),null);
                    end if;
                    set locationCount = locationCount + count; -- 入库时库存增加
	          when 2 THEN -- 出库
	            set locationCount = locationCount - count; -- 出库时库存减少
	          when 3 THEN -- 盘点
	            if locationUuid is not NULL then
	               set locationCount = locationCount + count; -- 
                end if;
	          when 4 THEN -- 调拨
	              set locationCount = locationCount - count; -- 调拨时库存减少
          end case;
            UPDATE inventory_location set location_count =  locationCount,update_date = now() where uuid = locationUuid;
end
;;
DELIMITER ;

-- ----------------------------
-- Function structure for countByStatus
-- ----------------------------
DROP FUNCTION IF EXISTS `countByStatus`;
DELIMITER ;;
CREATE  FUNCTION `countByStatus`(deviceUuid VARCHAR(17), _status_ INT) RETURNS int(11)
BEGIN
DECLARE done, my_temp, status INT DEFAULT 0;
select COUNT(*) INTO my_temp from change_status where device_uuid = deviceUuid AND now_status = _status_;
RETURN my_temp;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for isChild
-- ----------------------------
DROP FUNCTION IF EXISTS `isChild`;
DELIMITER ;;
CREATE  FUNCTION `isChild`(uuid_ VARCHAR(17)) RETURNS bit(1)
BEGIN
DECLARE temp BIT; -- 返回值
DECLARE count_ INT DEFAULT 0; -- 返回值
IF uuid_ is NULL THEN
	SET temp = FALSE;
ELSE
  SELECT COUNT(m.uuid) INTO count_ from menu_node m where m.parent_uuid=uuid_;
  IF count_ = 0 THEN
		SET temp = FALSE;
  ELSE
    SET temp = TRUE;
  END IF;
END IF;
RETURN temp;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for is_groups_unable_delete
-- ----------------------------
DROP FUNCTION IF EXISTS `is_groups_unable_delete`;
DELIMITER ;;
CREATE  FUNCTION `is_groups_unable_delete`(
	groups_uuid VARCHAR (17),
	tag INT,
	company_uuid VARCHAR (17)
) RETURNS bit(1)
BEGIN
	DECLARE	result BIT DEFAULT FALSE;	-- 返回结果
	DECLARE	count_waiting_for_audit INT DEFAULT 0;	-- 待审核订单的记录数
	DECLARE	count_auditing INT DEFAULT 0;	-- 审核中未被该组审核的订单的记录数

	-- 1:外委维修
	IF tag = 1 THEN	

		SELECT
			COUNT(repair_bills.uuid) INTO count_waiting_for_audit
		FROM
			repair_bills
		WHERE
			repair_bills.company_uuid = company_uuid
		AND repair_bills.is_delete = FALSE
		AND repair_bills.audit_status = 0;

		IF count_waiting_for_audit > 0 THEN -- 有待审核订单
			SET result = TRUE;
		ELSE	-- 无待审订单，查询审核中未被该组审核的订单
			SELECT
				COUNT(repair_bills.uuid) INTO count_auditing
			FROM
				repair_bills
			WHERE
				repair_bills.company_uuid = company_uuid
			AND repair_bills.is_delete = FALSE
			AND repair_bills.audit_status = 1
			AND EXISTS (SELECT	groups_uuid NOT IN (SELECT	repair_bills_audit.groups_uuid	FROM	repair_bills_audit	WHERE	repair_bills_audit.flow_uuid = repair_bills.flow_uuid));
			
			IF count_auditing > 0 THEN	-- 当审核中的订单，在该组有未审核的订单时，不能删除
				SET result = TRUE;
			END	IF;

		END	IF;

	-- 2:维修验证
	ELSEIF tag = 2 THEN

		SELECT
			COUNT(repair_bills.uuid) INTO count_waiting_for_audit
		FROM
			repair_bills
		WHERE
			repair_bills.company_uuid = company_uuid
		AND repair_bills.is_delete = FALSE
		AND repair_bills.verify_status = 0;

		IF count_waiting_for_audit > 0 THEN -- 有待审核订单
			SET result = TRUE;
		ELSE	-- 无待审订单，查询审核中未被该组审核的订单
			SELECT
				COUNT(repair_bills.uuid) INTO count_auditing
			FROM
				repair_bills
			WHERE
				repair_bills.company_uuid = company_uuid
			AND repair_bills.is_delete = FALSE
			AND repair_bills.audit_status = 1
			AND EXISTS (SELECT	groups_uuid NOT IN (SELECT	repair_bills_verify.groups_uuid	FROM	repair_bills_verify	WHERE	repair_bills_verify.flow_uuid = repair_bills.flow_uuid));
			
			IF count_auditing > 0 THEN	-- 当审核中的订单，在该组有未审核的订单时，不能删除
				SET result = TRUE;
			END	IF;

		END	IF;


	ELSEIF tag = 3 THEN-- 3:设备购置
		SELECT
			COUNT(purchase_bills.uuid) INTO count_waiting_for_audit
		FROM
			purchase_bills
		WHERE
			purchase_bills.company_uuid = company_uuid
		AND purchase_bills.is_delete = FALSE
		AND purchase_bills.audit_status = 0;


		IF count_waiting_for_audit > 0 THEN -- 有待审核订单
			SET result = TRUE;
		ELSE	-- 无待审订单，查询审核中未被该组审核的订单
			SELECT
				COUNT(purchase_bills.uuid) INTO count_auditing
			FROM
				purchase_bills
			WHERE
				purchase_bills.company_uuid = company_uuid
			AND purchase_bills.is_delete = FALSE
			AND purchase_bills.audit_status = 1
			AND EXISTS (SELECT	groups_uuid NOT IN (SELECT	purchase_bills_audit.groups_uuid	FROM	purchase_bills_audit	WHERE	purchase_bills_audit.purchase_bills_uuid = purchase_bills.uuid));
			
			IF count_auditing > 0 THEN	-- 当审核中的订单，在该组有未审核的订单时，不能删除
				SET result = TRUE;
			END	IF;
		END	IF;

	-- 4:设备调拨
	ELSEIF tag = 4 THEN

		SELECT
			COUNT(allocate_bills.uuid) INTO count_waiting_for_audit
		FROM
			allocate_bills
		WHERE
			allocate_bills.company_uuid = company_uuid
		AND allocate_bills.is_delete = FALSE
		AND allocate_bills.audit_status = 0;


		IF count_waiting_for_audit > 0 THEN -- 有待审核订单
			SET result = TRUE;
		ELSE	-- 无待审订单，查询审核中未被该组审核的订单
			SELECT
				COUNT(allocate_bills.uuid) INTO count_auditing
			FROM
				allocate_bills
			WHERE
				allocate_bills.company_uuid = company_uuid
			AND allocate_bills.is_delete = FALSE
			AND allocate_bills.audit_status = 1
			AND EXISTS (SELECT	groups_uuid NOT IN (SELECT	allocate_bills_audit.groups_uuid	FROM	allocate_bills_audit	WHERE	allocate_bills_audit.allocate_bills_uuid = allocate_bills.uuid));
			
			IF count_auditing > 0 THEN	-- 当审核中的订单，在该组有未审核的订单时，不能删除
				SET result = TRUE;
			END	IF;
		END	IF;

	-- 5:设备状态
	ELSEIF tag = 5 THEN 
		
		SELECT
        COUNT(change_status.uuid) INTO count_waiting_for_audit
    FROM
        change_status
    WHERE
        change_status.company_uuid = company_uuid
        AND change_status.is_delete = FALSE
        AND change_status.audit_status = 0;

    IF count_waiting_for_audit > 0 THEN -- 有待审核订单
        SET result = TRUE;
    ELSE    -- 无待审订单，查询审核中未被该组审核的订单
        SELECT
					COUNT(change_status.uuid) INTO count_auditing
        FROM
					change_status
				WHERE
          change_status.company_uuid = company_uuid
					AND change_status.is_delete = FALSE
          AND change_status.audit_status = 1
          AND EXISTS (SELECT    groups_uuid NOT IN (SELECT    change_status_audit.groups_uuid    FROM    change_status_audit    WHERE    change_status_audit.change_status_uuid = change_status.uuid));

        IF count_auditing > 0 THEN    -- 当审核中的订单，在该组有未审核的订单时，不能删除
					SET result = TRUE;
         END	IF;
		END	IF;

	ELSEIF tag = 6 THEN-- 6:设备领用

		SELECT
			COUNT(fetch_bills.uuid) INTO count_waiting_for_audit
    FROM
      fetch_bills
    WHERE
      fetch_bills.company_uuid = company_uuid
      AND fetch_bills.is_delete = FALSE
      AND fetch_bills.audit_status = 0;


    IF count_waiting_for_audit > 0 THEN -- 有待审核订单
			SET result = TRUE;
    ELSE    -- 无待审订单，查询审核中未被该组审核的订单
      SELECT
				COUNT(fetch_bills.uuid) INTO count_auditing
      FROM
        fetch_bills
      WHERE
        fetch_bills.company_uuid = company_uuid
        AND fetch_bills.is_delete = FALSE
        AND fetch_bills.audit_status = 1
        AND EXISTS (SELECT    groups_uuid NOT IN (SELECT    fetch_bills_audit.groups_uuid    FROM    fetch_bills_audit    WHERE    fetch_bills_audit.fetch_bills_uuid = fetch_bills.uuid));

			IF count_auditing > 0 THEN    -- 当审核中的订单，在该组有未审核的订单时，不能删除
				SET result = TRUE;
			END    IF;
    END    IF;

	END	IF;

	RETURN result;

END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for lastInventoryCount
-- ----------------------------
DROP FUNCTION IF EXISTS `lastInventoryCount`;
DELIMITER ;;
CREATE  FUNCTION `lastInventoryCount`(parts_uuid_ VARCHAR(17),beginTime VARCHAR(30),company_uuid_ VARCHAR(17)) RETURNS decimal(18,2)
BEGIN
    DECLARE lastInventoryCount decimal(18,2);

    select sum(if(re.is_inbound,re.count,0))-sum(if(re.is_inbound,0,re.count))
    INTO lastInventoryCount
    from inventory_record re
    left join inventory i on i.uuid = re.inventory_uuid
    where re.company_uuid = company_uuid_ and DATE(re.create_date) >  DATE(beginTime)
    and i.parts_uuid = parts_uuid_;
    return lastInventoryCount;
END
;;
DELIMITER ;

