-- ----------------------------
-- Function structure for node_is_permission
-- ----------------------------
DROP FUNCTION IF EXISTS `node_is_permission`;
DELIMITER ;;
CREATE  FUNCTION `node_is_permission`(node_uuid_ VARCHAR(25),groups_uuid_ VARCHAR(25)) RETURNS bit(1)
BEGIN
DECLARE temp BIT DEFAULT FALSE; -- 返回值
DECLARE count int(11) DEFAULT 0; -- 计数判断
SELECT COUNT(DISTINCT p.uuid) INTO count from permission p where p.group_uuid=groups_uuid_ and p.node_uuid=node_uuid_;
IF count is null OR count=0 OR count=0.0 OR count=0.00 THEN
	set temp=FALSE;
ELSEIF count>0 THEN
  set temp=TRUE;
END IF;
RETURN temp;
END
;;
DELIMITER ;

