-- ----------------------------
-- Function structure for queryDepartmentChildren
-- ----------------------------
DROP FUNCTION IF EXISTS `queryDepartmentChildren`;
DELIMITER ;;
CREATE  FUNCTION `queryDepartmentChildren`(department_uuid_ VARCHAR(17)) RETURNS varchar(4000) CHARSET utf8
BEGIN
    DECLARE sTemp VARCHAR(4000) DEFAULT '''d''';
    DECLARE sTempChd VARCHAR(4000) DEFAULT '';
    
    SET sTempChd = department_uuid_ ;
    
    WHILE sTempChd is not NULL DO
    SET sTemp = CONCAT(sTemp,',',sTempChd);
    SELECT group_concat(uuid) INTO sTempChd FROM department where FIND_IN_SET(parent_uuid,sTempChd)>0;
    END WHILE;
    return sTemp;
END
;;
DELIMITER ;

