-- ----------------------------
-- Function structure for queryNotOn
-- ----------------------------
DROP FUNCTION IF EXISTS `queryNotOn`;
DELIMITER ;;
CREATE  FUNCTION `queryNotOn`(parts_uuid_ VARCHAR(17),storage_uuid_ VARCHAR(17)) RETURNS decimal(18,2)
BEGIN
DECLARE temp DECIMAL(18,2); -- 返回值
DECLARE inventory_count_ DECIMAL(18,2); -- 库存量
DECLARE inventory_location_count_ DECIMAL(18,2); -- 库位库存量总数
SELECT i.inventory_count INTO inventory_count_ from parts p LEFT JOIN inventory i ON p.uuid=i.parts_uuid where p.uuid=parts_uuid_ and i.storage_uuid=storage_uuid_ ;
IF storage_uuid_ IS NULL THEN
 SET temp=0;
ELSE
	IF inventory_count_ is null OR inventory_count_=0 OR inventory_count_=0.0 OR inventory_count_=0.00 THEN 
		 SET temp=0;
	ELSEIF inventory_count_ > 0 THEN
		SELECT SUM(l.location_count) INTO inventory_location_count_ FROM inventory_location l LEFT JOIN inventory i ON l.inventory_uuid=i.uuid where i.storage_uuid=storage_uuid_ and i.parts_uuid=parts_uuid_ GROUP BY i.storage_uuid;
		IF inventory_location_count_ IS NULL OR inventory_location_count_=0 OR inventory_location_count_=0.0 OR inventory_location_count_=0.00 THEN
			SET temp=inventory_count_;
		ELSEIF  inventory_location_count_ > 0 THEN
			SET temp = inventory_count_-inventory_location_count_;
		END IF;
	END IF;
END IF; 
RETURN temp;
END
;;
DELIMITER ;

