-- ----------------------------
-- Function structure for _Navicat_Temp_Stored_Proc
-- ----------------------------
DROP FUNCTION IF EXISTS `_Navicat_Temp_Stored_Proc`;
DELIMITER ;;
CREATE  FUNCTION `_Navicat_Temp_Stored_Proc`(groups_uuid VARCHAR (17),
	tag INT,
	company_uuid VARCHAR (17)) RETURNS bit(1)
BEGIN
	DECLARE	result BIT DEFAULT FALSE;	-- 返回结果
	DECLARE	count_waiting_for_audit INT DEFAULT 0;	-- 待审核订单的记录数
	DECLARE	count_auditing INT DEFAULT 0;	-- 审核中未被该组审核的订单的记录数

	-- 1:外委维修
	IF tag = 1 THEN	

		SELECT
			COUNT(repair_bills.uuid) INTO count_waiting_for_audit
		FROM
			repair_bills
		WHERE
			repair_bills.company_uuid = company_uuid
		AND repair_bills.is_delete = FALSE
		AND repair_bills.audit_status = 0;

		IF count_waiting_for_audit > 0 THEN -- 有待审核订单
			SET result = TRUE;
		ELSE	-- 无待审订单，查询审核中未被该组审核的订单
			SELECT
				COUNT(repair_bills.uuid) INTO count_auditing
			FROM
				repair_bills
			WHERE
				repair_bills.company_uuid = company_uuid
			AND repair_bills.is_delete = FALSE
			AND repair_bills.audit_status = 1
			AND EXISTS (SELECT	groups_uuid NOT IN (SELECT	repair_bills_audit.groups_uuid	FROM	repair_bills_audit	WHERE	repair_bills_audit.flow_uuid = repair_bills.flow_uuid));
			
			IF count_auditing > 0 THEN	-- 当审核中的订单，在该组有未审核的订单时，不能删除
				SET result = TRUE;
			END	IF;

		END	IF;

	-- 2:维修验证
	ELSEIF tag = 2 THEN

		SELECT
			COUNT(repair_bills.uuid) INTO count_waiting_for_audit
		FROM
			repair_bills
		WHERE
			repair_bills.company_uuid = company_uuid
		AND repair_bills.is_delete = FALSE
		AND repair_bills.verify_status = 0;

		IF count_waiting_for_audit > 0 THEN -- 有待审核订单
			SET result = TRUE;
		ELSE	-- 无待审订单，查询审核中未被该组审核的订单
			SELECT
				COUNT(repair_bills.uuid) INTO count_auditing
			FROM
				repair_bills
			WHERE
				repair_bills.company_uuid = company_uuid
			AND repair_bills.is_delete = FALSE
			AND repair_bills.audit_status = 1
			AND EXISTS (SELECT	groups_uuid NOT IN (SELECT	repair_bills_verify.groups_uuid	FROM	repair_bills_verify	WHERE	repair_bills_verify.flow_uuid = repair_bills.flow_uuid));
			
			IF count_auditing > 0 THEN	-- 当审核中的订单，在该组有未审核的订单时，不能删除
				SET result = TRUE;
			END	IF;

		END	IF;


	ELSEIF tag = 3 THEN-- 3:设备购置
		SELECT
			COUNT(purchase_bills.uuid) INTO count_waiting_for_audit
		FROM
			purchase_bills
		WHERE
			purchase_bills.company_uuid = company_uuid
		AND purchase_bills.is_delete = FALSE
		AND purchase_bills.audit_status = 0;


		IF count_waiting_for_audit > 0 THEN -- 有待审核订单
			SET result = TRUE;
		ELSE	-- 无待审订单，查询审核中未被该组审核的订单
			SELECT
				COUNT(purchase_bills.uuid) INTO count_auditing
			FROM
				purchase_bills
			WHERE
				purchase_bills.company_uuid = company_uuid
			AND purchase_bills.is_delete = FALSE
			AND purchase_bills.audit_status = 1
			AND EXISTS (SELECT	groups_uuid NOT IN (SELECT	purchase_bills_audit.groups_uuid	FROM	purchase_bills_audit	WHERE	purchase_bills_audit.purchase_bills_uuid = purchase_bills.uuid));
			
			IF count_auditing > 0 THEN	-- 当审核中的订单，在该组有未审核的订单时，不能删除
				SET result = TRUE;
			END	IF;
		END	IF;

	-- 4:设备调拨
	ELSEIF tag = 4 THEN

		SELECT
			COUNT(allocate_bills.uuid) INTO count_waiting_for_audit
		FROM
			allocate_bills
		WHERE
			allocate_bills.company_uuid = company_uuid
		AND allocate_bills.is_delete = FALSE
		AND allocate_bills.audit_status = 0;


		IF count_waiting_for_audit > 0 THEN -- 有待审核订单
			SET result = TRUE;
		ELSE	-- 无待审订单，查询审核中未被该组审核的订单
			SELECT
				COUNT(allocate_bills.uuid) INTO count_auditing
			FROM
				allocate_bills
			WHERE
				allocate_bills.company_uuid = company_uuid
			AND allocate_bills.is_delete = FALSE
			AND allocate_bills.audit_status = 1
			AND EXISTS (SELECT	groups_uuid NOT IN (SELECT	allocate_bills_audit.groups_uuid	FROM	allocate_bills_audit	WHERE	allocate_bills_audit.allocate_bills_uuid = allocate_bills.uuid));
			
			IF count_auditing > 0 THEN	-- 当审核中的订单，在该组有未审核的订单时，不能删除
				SET result = TRUE;
			END	IF;
		END	IF;

	-- 5:设备状态
	ELSEIF tag = 5 THEN 
		
		SELECT
			COUNT(allocate_bills.uuid) INTO count_waiting_for_audit
		FROM
			allocate_bills
		WHERE
			allocate_bills.company_uuid = company_uuid
		AND allocate_bills.is_delete = FALSE
		AND allocate_bills.audit_status = 0;


		IF count_waiting_for_audit > 0 THEN -- 有待审核订单
			SET result = TRUE;
		ELSE	-- 无待审订单，查询审核中未被该组审核的订单
			SELECT
				COUNT(allocate_bills.uuid) INTO count_auditing
			FROM
				allocate_bills
			WHERE
				allocate_bills.company_uuid = company_uuid
			AND allocate_bills.is_delete = FALSE
			AND allocate_bills.audit_status = 1
			AND EXISTS (SELECT	groups_uuid NOT IN (SELECT	allocate_bills_audit.groups_uuid	FROM	allocate_bills_audit	WHERE	allocate_bills_audit.allocate_bills_uuid = allocate_bills.uuid));
			
			IF count_auditing > 0 THEN	-- 当审核中的订单，在该组有未审核的订单时，不能删除
				SET result = TRUE;
			END	IF;
		END	IF;


ELSEIF tag = 6 THEN
	-- 6:设备领用
SET result = TRUE;


END
IF;

RETURN result;


END
;;
DELIMITER ;
